INSERT INTO `ms_article_body` VALUES (1730416949435613187, '## 效果\n> 见本站右下角\n\n## 实现目标⁍\n 采用hexo-helper-live2d插件实现，参考 hexo live2d插件 2.0 ! | 幻想帖 (huaji8.top)\n 配置添加对话/文字功能\n 修改为自己想要的live2d形象（Eikanya/Live2d-model: Live2d model collection (github.com)，梦象 (paul.ren)）\n 和音乐播放器合在一起？（暂不考虑）\nhexo-helper-live2d插件安装与配置⁍\nEYHN/hexo-helper-live2d: Add the Sseexxyyy live2d to your hexo! (github.com)\n\n## 安装插件⁍\n在站点根目录下打开终端，输入以下命令\n``` bash\nnpm install --save hexo-helper-live2d\n```\n选择并安装模型\n``` bash\nnpm install --save live2d-widget-model-wanko\n```\n更多模型见hexo live2d插件 2.0 ! | 幻想帖 (huaji8.top)\n## 配置\n打开站点配置文件_config.yml，添加live2d项，如下\n``` yml\n# live2d\n# https://github.com/EYHN/hexo-helper-live2d\nlive2d:\n  enable: true # 是否启用看板娘\n  scriptFrom: local # 默认\n  pluginRootPath: live2dw/ # 插件在站点上的根目录(相对路径)，自动生成\n  pluginJsPath: lib/ # 脚本文件相对与插件根目录路径\n  pluginModelPath: assets/ # 模型文件相对与插件根目录路径\n  # scriptFrom: jsdelivr    # jsdelivr CDN\n  # scriptFrom: unpkg    # unpkg CDN\n  # scriptFrom: https://cdn.jsdelivr.net/npm/live2d-widget@3.x/lib/L2Dwidget.min.js    # 你的自定义 url\n  tagMode: false # 标签模式, 是否仅替换 live2d tag标签而非插入到所有页面中，具体见项目github描述\n  debug: false # 调试, 是否在控制台输出日志\n  model:\n    use: live2d-widget-model-wanko # live2d模型的名字\n    scale: 1\n    hHeadPos: 0.5\n    vHeadPos: 0.618\n  display:\n    superSample: 2\n    width: 200\n    height: 400\n    position: left # 左侧还是右侧\n    hOffset: 20\n    vOffset: 0 # 距底部距离\n  mobile:\n    show: false # 手机端是否可见\n    scale: 0.5\n  react:\n    opacityDefault: 0.7\n    opacityOnHover: 0.2\n```', '<h2><a id=\"_0\"></a>效果</h2>\n<blockquote>\n<p>见本站右下角</p>\n</blockquote>\n<h2><a id=\"_3\"></a>实现目标⁍</h2>\n<p>采用hexo-helper-live2d插件实现，参考 hexo live2d插件 2.0 ! | 幻想帖 (huaji8.top)<br />\n配置添加对话/文字功能<br />\n修改为自己想要的live2d形象（Eikanya/Live2d-model: Live2d model collection (github.com)，梦象 (paul.ren)）<br />\n和音乐播放器合在一起？（暂不考虑）<br />\nhexo-helper-live2d插件安装与配置⁍<br />\nEYHN/hexo-helper-live2d: Add the Sseexxyyy live2d to your hexo! (github.com)</p>\n<h2><a id=\"_11\"></a>安装插件⁍</h2>\n<p>在站点根目录下打开终端，输入以下命令</p>\n<pre><div class=\"hljs\"><code class=\"lang-bash\">npm install --save hexo-helper-live2d\n</code></div></pre>\n<p>选择并安装模型</p>\n<pre><div class=\"hljs\"><code class=\"lang-bash\">npm install --save live2d-widget-model-wanko\n</code></div></pre>\n<p>更多模型见hexo live2d插件 2.0 ! | 幻想帖 (huaji8.top)</p>\n<h2><a id=\"_21\"></a>配置</h2>\n<p>打开站点配置文件_config.yml，添加live2d项，如下</p>\n<pre><div class=\"hljs\"><code class=\"lang-yml\"><span class=\"hljs-comment\"># live2d</span>\n<span class=\"hljs-comment\"># https://github.com/EYHN/hexo-helper-live2d</span>\n<span class=\"hljs-attr\">live2d:</span>\n<span class=\"hljs-attr\">  enable:</span> <span class=\"hljs-literal\">true</span> <span class=\"hljs-comment\"># 是否启用看板娘</span>\n<span class=\"hljs-attr\">  scriptFrom:</span> <span class=\"hljs-string\">local</span> <span class=\"hljs-comment\"># 默认</span>\n<span class=\"hljs-attr\">  pluginRootPath:</span> <span class=\"hljs-string\">live2dw/</span> <span class=\"hljs-comment\"># 插件在站点上的根目录(相对路径)，自动生成</span>\n<span class=\"hljs-attr\">  pluginJsPath:</span> <span class=\"hljs-string\">lib/</span> <span class=\"hljs-comment\"># 脚本文件相对与插件根目录路径</span>\n<span class=\"hljs-attr\">  pluginModelPath:</span> <span class=\"hljs-string\">assets/</span> <span class=\"hljs-comment\"># 模型文件相对与插件根目录路径</span>\n  <span class=\"hljs-comment\"># scriptFrom: jsdelivr    # jsdelivr CDN</span>\n  <span class=\"hljs-comment\"># scriptFrom: unpkg    # unpkg CDN</span>\n  <span class=\"hljs-comment\"># scriptFrom: https://cdn.jsdelivr.net/npm/live2d-widget@3.x/lib/L2Dwidget.min.js    # 你的自定义 url</span>\n<span class=\"hljs-attr\">  tagMode:</span> <span class=\"hljs-literal\">false</span> <span class=\"hljs-comment\"># 标签模式, 是否仅替换 live2d tag标签而非插入到所有页面中，具体见项目github描述</span>\n<span class=\"hljs-attr\">  debug:</span> <span class=\"hljs-literal\">false</span> <span class=\"hljs-comment\"># 调试, 是否在控制台输出日志</span>\n<span class=\"hljs-attr\">  model:</span>\n<span class=\"hljs-attr\">    use:</span> <span class=\"hljs-string\">live2d-widget-model-wanko</span> <span class=\"hljs-comment\"># live2d模型的名字</span>\n<span class=\"hljs-attr\">    scale:</span> <span class=\"hljs-number\">1</span>\n<span class=\"hljs-attr\">    hHeadPos:</span> <span class=\"hljs-number\">0.5</span>\n<span class=\"hljs-attr\">    vHeadPos:</span> <span class=\"hljs-number\">0.618</span>\n<span class=\"hljs-attr\">  display:</span>\n<span class=\"hljs-attr\">    superSample:</span> <span class=\"hljs-number\">2</span>\n<span class=\"hljs-attr\">    width:</span> <span class=\"hljs-number\">200</span>\n<span class=\"hljs-attr\">    height:</span> <span class=\"hljs-number\">400</span>\n<span class=\"hljs-attr\">    position:</span> <span class=\"hljs-string\">left</span> <span class=\"hljs-comment\"># 左侧还是右侧</span>\n<span class=\"hljs-attr\">    hOffset:</span> <span class=\"hljs-number\">20</span>\n<span class=\"hljs-attr\">    vOffset:</span> <span class=\"hljs-number\">0</span> <span class=\"hljs-comment\"># 距底部距离</span>\n<span class=\"hljs-attr\">  mobile:</span>\n<span class=\"hljs-attr\">    show:</span> <span class=\"hljs-literal\">false</span> <span class=\"hljs-comment\"># 手机端是否可见</span>\n<span class=\"hljs-attr\">    scale:</span> <span class=\"hljs-number\">0.5</span>\n<span class=\"hljs-attr\">  react:</span>\n<span class=\"hljs-attr\">    opacityDefault:</span> <span class=\"hljs-number\">0.7</span>\n<span class=\"hljs-attr\">    opacityOnHover:</span> <span class=\"hljs-number\">0.2</span>\n</code></div></pre>\n', 1730416949368504322);
INSERT INTO `ms_article_body` VALUES (1730417401434783748, '# MySQL简介\nMySQL是一个开放源码的小型关联式数据库管理系统，开发者为瑞典MySQL AB公司。目前MySQL被广泛地应用在Internet上的中小型网站中。由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，许多中小型网站为了降低网站总体拥有成本而选择了MySQL作为网站数据库。\n\nMySQL这个名字是怎么来的已经不清楚了。基本指南和大量的库和工具带有前缀“my”已经有10年以上，而且不管怎样，MySQL AB创始人之一的的女儿也叫My。这两个到底是哪一个给出了MySQL这个名字至今依然是个迷，包括开发者在内也不知道。\n\nMySQL的海豚标志的名字叫“sakila”，它是由MySQL AB的创始人从用户在“海豚命名”的竞赛中建议的大量的名字表中选出的。获胜的名字是由来自非洲斯威士兰的开源软件开发者Ambrose Twebaze提供。根据Ambrose所说，Sakila来自一种叫SiSwati的斯威士兰方言，也是在Ambrose的家乡乌干达附近的坦桑尼亚的Arusha的一个小镇的名字。\n\n2008年1月16日MySQL AB被Sun公司收购。而2009年，SUN又被Oracle收购。就这样如同一个轮回，MySQL成为了Oracle公司的另一个数据库项目。\n\nMySQL是数据库的一种，具有数据库的通用特征，同时，比起其他类型的数据库，它还具有自己鲜明的特点。', '<h1><a id=\"MySQL_0\"></a>MySQL简介</h1>\n<p>MySQL是一个开放源码的小型关联式数据库管理系统，开发者为瑞典MySQL AB公司。目前MySQL被广泛地应用在Internet上的中小型网站中。由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，许多中小型网站为了降低网站总体拥有成本而选择了MySQL作为网站数据库。</p>\n<p>MySQL这个名字是怎么来的已经不清楚了。基本指南和大量的库和工具带有前缀“my”已经有10年以上，而且不管怎样，MySQL AB创始人之一的的女儿也叫My。这两个到底是哪一个给出了MySQL这个名字至今依然是个迷，包括开发者在内也不知道。</p>\n<p>MySQL的海豚标志的名字叫“sakila”，它是由MySQL AB的创始人从用户在“海豚命名”的竞赛中建议的大量的名字表中选出的。获胜的名字是由来自非洲斯威士兰的开源软件开发者Ambrose Twebaze提供。根据Ambrose所说，Sakila来自一种叫SiSwati的斯威士兰方言，也是在Ambrose的家乡乌干达附近的坦桑尼亚的Arusha的一个小镇的名字。</p>\n<p>2008年1月16日MySQL AB被Sun公司收购。而2009年，SUN又被Oracle收购。就这样如同一个轮回，MySQL成为了Oracle公司的另一个数据库项目。</p>\n<p>MySQL是数据库的一种，具有数据库的通用特征，同时，比起其他类型的数据库，它还具有自己鲜明的特点。</p>\n', 1730417401434783746);
INSERT INTO `ms_article_body` VALUES (1730417766767050755, '# 单元测试例题\n\n### 例题1：填写快递单时通常需要确定接收人的姓名、手机号和地址。其中要求==手机号是 11 位数字字符==，==地址为字母开头的 10个（含10）以内字母或字母数字共同组成==。填写正确则提示“OK”，否则根据实际情况提示“**不符合要求”（**为手机号或地址）,退出。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足判定覆盖测试，每条测试数据需要在测试类中编写一个测试方法。使用assertThat中equalTo断言判断输出文字期望结果值和实际返回值是否一致。\n\n> 1. 编写一个静态方法`validate(String name, String phone, String address)`，用于验证快递单上的姓名、手机号和地址是否符合要求\n\n```java\npublic class ExpressInformationValidator {\n    public static String validate(String name, String phone, String address) {\n        // 验证手机号格式是否正确\n        if (!phone.matches(\"\\\\d{11}\")) {\n            return \"手机号不符合要求\";\n        }\n        \n        // 验证地址格式是否正确\n        if (!address.matches(\"[a-zA-Z][a-zA-Z0-9]{0,9}\")) {\n            return \"地址不符合要求\";\n        }\n        \n        return \"OK\";\n    }\n}\n```\n\n> 2.编写一个测试类`ExpressInformationValidatorTest`，使用JUnit框架对`ExpressInformationValidator`类中的方法进行测试\n\n```java\nimport org.junit.Test;\n\nimport static org.hamcrest.CoreMatchers.equalTo;\nimport static org.junit.Assert.assertThat;\n\npublic class ExpressInformationValidatorTest {\n    @Test\n    public void testValidInformation() {\n        assertThat(ExpressInformationValidator.validate(\"张三\", \"13888888888\", \"A123Bcdefg\"), equalTo(\"OK\"));\n        assertThat(ExpressInformationValidator.validate(\"李四\", \"13999999999\", \"AbcdeFGHIJ\"), equalTo(\"OK\"));\n    }\n    \n    @Test\n    public void testInvalidPhoneNumber() {\n        assertThat(ExpressInformationValidator.validate(\"王五\", \"1234567890\", \"A1bcdefghi\"), equalTo(\"手机号不符合要求\"));\n        assertThat(ExpressInformationValidator.validate(\"赵六\", \"13888888a8\", \"A1bcdefghi\"), equalTo(\"手机号不符合要求\"));\n    }\n    \n    @Test\n    public void testInvalidAddress() {\n        assertThat(ExpressInformationValidator.validate(\"孙七\", \"13777777777\", \"123ABcdefg\"), equalTo(\"地址不符合要求\"));\n        assertThat(ExpressInformationValidator.validate(\"周八\", \"13666666666\", \"AbcdeFGHIJK\"), equalTo(\"地址不符合要求\"));\n    }\n}\n```\n\n### 例题2：测试一个字符串是否为空\n\n```java\npublic class StringUtils {\n    public boolean isEmpty(String str) {\n        return str == null || str.isEmpty();\n    }\n}\n\n@Test\npublic void testEmptyString() {\n    StringUtils stringUtils = new StringUtils();\n    String str = \"\";\n    assertTrue(stringUtils.isEmpty(str));\n}\n```\n\n### 例题3：测试一个字符串是否包含另一个字符串\n\n```java\npublic class StringUtils {\n    public boolean contains(String str, String subStr) {\n        return str.contains(subStr);\n    }\n}\n\n@Test\npublic void testStringContains() {\n    StringUtils stringUtils = new StringUtils();\n    String str = \"Hello, world!\";\n    String subStr = \"world\";\n    assertTrue(stringUtils.contains(str, subStr));\n}\n```\n\n### 例题4:测试一个日期是否为闰年\n\n> 编写一个名为DateUtils的被测类\n\n```java\npublic class DateUtils {\n    public boolean isLeapYear(int year) {\n        if (year % 4 == 0 && year % 100 != 0 || year % 400 == 0) {\n            return true;\n        }\n        return false;\n    }\n}\n```\n\n> 编写一个testLeapYear的测试类\n\n```java\n@Test\npublic void testLeapYear() {\n    DateUtils dateUtils = new DateUtils();\n	int year = 2020;\n	assertTrue(dateUtils.isLeapYear(year));\n}\n```\n\n### 例题5:==根据输入的年份和月份判断月份的天数==。若==月份不在有效范围之内，应提示：“月份输入不正确。”==。==月份不为2月，根据输入月份输出对应的月份天数==。月份为2月，根据年份判断如为普通闰年，输出2月份正确天数；如为世纪闰年，输出2月份正确天数；不为闰年输出2月份天数。返回结果格式：==“year年month月份的天数是days天。”==year、month为传入的值，days为判断得到的天数值。其中变量year、month均须为正整数。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足语句覆盖测试，每条测试数据需要在测试类中编写一个测试方法。使用assertThat中equalTo断言判断返回期望结果和实际返回是否一致。\n\n> 被测类\n\n```java\npublic class MonthDays {\n    public static String getMonthDays(int year, int month) {\n        int days = 0;\n        if (month < 1 || month > 12) {\n            return \"月份输入不正确。\";\n        } else if (month != 2) {\n            switch (month) {\n                case 4:\n                case 6:\n                case 9:\n                case 11:\n                    days = 30;\n                    break;\n                default:\n                    days = 31;\n                    break;\n            }\n        } else {\n            if (year % 4 == 0 && year % 100 != 0 || year % 400 == 0) {\n                days = 29;\n            } else {\n                days = 28;\n            }\n        }\n        return year + \"年\" + month + \"月份的天数是\" + days + \"天。\";\n    }\n}\n```\n\n> 测试类\n\n```java\nimport org.junit.Test;\nimport static org.hamcrest.CoreMatchers.equalTo;\nimport static org.junit.Assert.assertThat;\n\npublic class MonthDaysTest {\n    @Test\n    public void testMonthDays1() {\n        assertThat(MonthDays.getMonthDays(2022, 2), equalTo(\"2022年2月份的天数是28天。\"));\n    }\n\n    @Test\n    public void testMonthDays2() {\n        assertThat(MonthDays.getMonthDays(2022, 4), equalTo(\"2022年4月份的天数是30天。\"));\n    }\n\n    @Test\n    public void testMonthDays3() {\n        assertThat(MonthDays.getMonthDays(2022, 12), equalTo(\"2022年12月份的天数是31天。\"));\n    }\n\n    @Test\n    public void testMonthDays4() {\n        assertThat(MonthDays.getMonthDays(2022, 0), equalTo(\"月份输入不正确。\"));\n    }\n}\n```\n\n### 例题6:`输入小写的字符串`。`如字符串前缀为ab开头，则将前缀ab替换为ef并打印出替换后字符串，返回文字“替换前缀后的字符串为:”和替换后字符串值`；如`后缀为cd并且前缀不为ab`，替换字符串中`所有cd为gh`并打印出替换后字符串，返回文字`“替换cd后的字符串为:”和替换后字符串值`;否则全部字母大写输出，返回文字“大写字母的字符串为:”和转换后的字符串值。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足条件覆盖测试，测试类==使用参数化测试（@Parameters）完成测试==。使用assertEquals判断期望结果值和实际返回值是否一致\n\n> 被测类\n\n```java\npublic class StringReplace {\n    public static String replaceString(String str) {\n        if (str.startsWith(\"ab\")) {\n            String newStr = str.replaceFirst(\"ab\", \"ef\");\n            System.out.println(\"替换前缀后的字符串为：\" + newStr);\n            return \"替换前缀后的字符串为：\" + newStr;\n        } else if (str.endsWith(\"cd\") && !str.startsWith(\"ab\")) {\n            String newStr = str.replaceAll(\"cd\", \"gh\");\n            System.out.println(\"替换cd后的字符串为：\" + newStr);\n            return \"替换cd后的字符串为：\" + newStr;\n        } else {\n            String newStr = str.toUpperCase();\n            System.out.println(\"大写字母的字符串为：\" + newStr);\n            return \"大写字母的字符串为：\" + newStr;\n        }\n    }\n}\n```\n\n> 测试类,使用参数化测试\n\n```java\nimport java.util.Arrays;\nimport java.util.Collection;\n\nimport org.junit.Test;\nimport org.junit.runner.RunWith;\nimport org.junit.runners.Parameterized;\nimport org.junit.runners.Parameterized.Parameters;\nimport static org.junit.Assert.assertEquals;\n\n@RunWith(Parameterized.class)\npublic class StringReplaceTest {\n    private String input;\n    private String expectedOutput;\n\n    public StringReplaceTest(String input, String expectedOutput) {\n        this.input = input;\n        this.expectedOutput = expectedOutput;\n    }\n\n    @Parameterized.Parameters\n    public static Collection<Object[]> data() {\n        return Arrays.asList(new Object[][]{\n                {\"abcdef\", \"替换前缀后的字符串为：efcdef\"},\n                {\"abxyz\", \"替换前缀后的字符串为：efxyz\"},\n                {\"cdxyz\", \"替换cd后的字符串为：ghxyz\"},\n                {\"abcd\", \"替换前缀后的字符串为：efcd\"},\n                {\"ab\", \"替换前缀后的字符串为：ef\"},\n                {\"cdef\", \"大写字母的字符串为：CDEF\"},\n                {\"ABCDEF\", \"大写字母的字符串为：ABCDEF\"},\n                {\"\", \"大写字母的字符串为：\"}\n        });\n    }\n\n    @Test\n    public void testReplaceString() {\n        assertEquals(expectedOutput, StringReplace.replaceString(input));\n    }\n}\n```\n\n### 例题7:邮箱注册需要填写邮箱地址和密码。其中要求`邮箱格式“登录名@主机名.域名”`，`登录名为5个字母`，`主机名固定为下面2个163、126，域名为com或com.cn。密码为6个（含6）以上数字组成`。填写正确则提示“信息正确”，否则根据实际情况提示“**不符合要求”（**为邮箱地址或密码）。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足语句覆盖测试，每条测试数据需要在测试类中编写一个测试方法。使用assertThat中equalTo断言判断输出文字期望结果值和实际返回值是否一致。\n\n> 被测类\n\n```java\npublic class EmailRegister {\n    public static String checkEmail(String email, String password) {\n        String regex = \"[a-zA-Z]{5}@(163|126)\\\\.(com|com\\\\.cn)\";\n        String regexPassword = \"\\\\d{6,}\";\n        if (email.matches(regex) && password.matches(regexPassword)) {\n            return \"信息正确\";\n        } else if (!email.matches(regex)) {\n            return \"邮箱地址不符合要求\";\n        } else {\n            return \"密码不符合要求\";\n        }\n    }\n}\n```\n\n> 测试类\n\n```java\nimport org.junit.Test;\nimport static org.hamcrest.CoreMatchers.equalTo;\nimport static org.junit.Assert.assertThat;\n\npublic class EmailRegisterTest {\n    @Test\n    public void testCheckEmail() {\n        assertThat(EmailRegister.checkEmail(\"abcde@163.com\", \"123456\"), equalTo(\"信息正确\"));\n        assertThat(EmailRegister.checkEmail(\"abcde@126.com.cn\", \"123456\"), equalTo(\"信息正确\"));\n        assertThat(EmailRegister.checkEmail(\"abcde@163.com.cn\", \"123456\"), equalTo(\"邮箱地址不符合要求\"));\n        assertThat(EmailRegister.checkEmail(\"abcde@126.com\", \"12345\"), equalTo(\"密码不符合要求\"));\n        assertThat(EmailRegister.checkEmail(\"abcde@163.com\", \"12345a\"), equalTo(\"密码不符合要求\"));\n    }\n}\n```\n\n### 例题8：请编写一个程序，`实现一个简单的计算器功能`，支持加、减、乘、除四种运算。程序接受两个整数作为输入，根据用户输入的运算符进行相应的运算，并输出结果。如果用户输入的运算符不是加、减、乘、除中的一种，则输出\"运算符不合法\"。、\n\n> 被测类\n\n```java\npublic class Calculator {\n    public int calculate(int a, int b, String operator) {\n        int result = 0;\n        switch (operator) {\n            case \"+\":\n                result = a + b;\n                break;\n            case \"-\":\n                result = a - b;\n                break;\n            case \"*\":\n                result = a * b;\n                break;\n            case \"/\":\n                if (b == 0) {\n                    throw new IllegalArgumentException(\"除数不能为0\");\n                }\n                result = a / b;\n                break;\n            default:\n                throw new IllegalArgumentException(\"运算符不合法\");\n        }\n        return result;\n    }\n}\n```\n\n> 测试类\n\n```java\nimport org.junit.After;\nimport org.junit.Before;\nimport org.junit.Test;\nimport static org.hamcrest.CoreMatchers.equalTo;\nimport static org.junit.Assert.assertThat;\n\npublic class CalculatorTest {\n    private Calculator calculator;\n\n    @Before\n    public void setUp() {\n        calculator = new Calculator();\n    }\n\n    @After\n    public void tearDown() {\n        calculator = null;\n    }\n\n    @Test\n    public void testAdd() {\n        assertThat(calculator.calculate(1, 2, \"+\"), equalTo(3));\n    }\n\n    @Test\n    public void testSubtract() {\n        assertThat(calculator.calculate(3, 2, \"-\"), equalTo(1));\n    }\n\n    @Test\n    public void testMultiply() {\n        assertThat(calculator.calculate(2, 3, \"*\"), equalTo(6));\n    }\n\n    @Test\n    public void testDivide() {\n        assertThat(calculator.calculate(6, 3, \"/\"), equalTo(2));\n    }\n\n    @Test(expected = IllegalArgumentException.class)\n    public void testDivideByZero() {\n        calculator.calculate(6, 0, \"/\");\n    }\n\n    @Test(expected = IllegalArgumentException.class)\n    public void testInvalidOperator() {\n        calculator.calculate(1, 2, \"invalid\");\n    }\n}\n```\n\n### 例题9:请编写一个程序，实现`一个简单的加法功能`。程序接受两个整数作为输入，返回它们的`和`。(`使用参数化`)\n\n> 被测试类\n\n```java\npublic class Calculator {\n    public int add(int a, int b) {\n        return a + b;\n    }\n}\n```\n\n> 测试类\n\n```java\nimport org.junit.After;\nimport org.junit.Before;\nimport org.junit.Test;\nimport org.junit.runner.RunWith;\nimport org.junit.runners.Parameterized;\nimport java.util.Arrays;\nimport java.util.Collection;\nimport static org.hamcrest.CoreMatchers.equalTo;\nimport static org.junit.Assert.assertThat;\n\n@RunWith(Parameterized.class)\npublic class CalculatorTest {\n    private Calculator calculator;\n    private int a;\n    private int b;\n    private int expected;\n\n    @Before\n    public void setUp() {\n        calculator = new Calculator();\n    }\n\n    @After\n    public void tearDown() {\n        calculator = null;\n    }\n\n    public CalculatorTest(int a, int b, int expected) {\n        this.a = a;\n        this.b = b;\n        this.expected = expected;\n    }\n\n    @Parameterized.Parameters\n    public static Collection<Object[]> data() {\n        return Arrays.asList(new Object[][] {\n                { 1, 2, 3 },\n                { -1, 1, 0 },\n                { 0, 0, 0 },\n                { Integer.MAX_VALUE, 1, Integer.MIN_VALUE },\n                { Integer.MIN_VALUE, -1, Integer.MAX_VALUE },\n        });\n    }\n\n    @Test\n    public void testAdd() {\n        assertThat(calculator.add(a, b), equalTo(expected));\n    }\n}\n```\n\n### 例题10：请编写一个名为`isPrime`的方法，该方法接受一个整数作为参数，如果该整数是`质数`，则返回`true`，否则返回`false`。请编写Junit单元测试来测试该方法的正确性\n\n> **质数**（Prime number），又称[素数](https://so.csdn.net/so/search?q=素数&spm=1001.2101.3001.7020)，指在大于1的自然数中，除了1和该数自身外，**无法被其他自然数整除**的数。（也可定义为只有1与该数本身两个正因数的数）\n\n> 被测类\n\n```java\npublic class PrimeChecker {\n    public static boolean isPrime(int number) {\n        if (number < 2) {\n            return false;\n        }\n        for (int i = 2; i <= Math.sqrt(number); i++) {\n            if (number % i == 0) {\n                return false;\n            }\n        }\n        return true;\n    }\n}\n```\n\n> 测试类\n\n```java\nimport org.junit.Test;\nimport static org.junit.Assert.*;\n\npublic class PrimeCheckerTest {\n    @Test\n    public void testIsPrime() {\n        assertTrue(PrimeChecker.isPrime(2));\n        assertTrue(PrimeChecker.isPrime(3));\n        assertTrue(PrimeChecker.isPrime(5));\n        assertTrue(PrimeChecker.isPrime(7));\n        assertTrue(PrimeChecker.isPrime(11));\n        assertTrue(PrimeChecker.isPrime(13));\n        assertTrue(PrimeChecker.isPrime(17));\n        assertTrue(PrimeChecker.isPrime(19));\n        assertTrue(PrimeChecker.isPrime(23));\n        assertTrue(PrimeChecker.isPrime(29));\n        assertFalse(PrimeChecker.isPrime(1));\n        assertFalse(PrimeChecker.isPrime(4));\n        assertFalse(PrimeChecker.isPrime(6));\n        assertFalse(PrimeChecker.isPrime(8));\n        assertFalse(PrimeChecker.isPrime(9));\n        assertFalse(PrimeChecker.isPrime(10));\n        assertFalse(PrimeChecker.isPrime(12));\n        assertFalse(PrimeChecker.isPrime(14));\n        assertFalse(PrimeChecker.isPrime(15));\n        assertFalse(PrimeChecker.isPrime(16));\n        assertFalse(PrimeChecker.isPrime(18));\n        assertFalse(PrimeChecker.isPrime(20));\n        assertFalse(PrimeChecker.isPrime(21));\n        assertFalse(PrimeChecker.isPrime(22));\n        assertFalse(PrimeChecker.isPrime(24));\n        assertFalse(PrimeChecker.isPrime(25));\n        assertFalse(PrimeChecker.isPrime(26));\n        assertFalse(PrimeChecker.isPrime(27));\n        assertFalse(PrimeChecker.isPrime(28));\n        assertFalse(PrimeChecker.isPrime(30));\n    }\n}\n```\n\n### 例题11:请编写一个名为reverse的方法，该方法接受一个`字符串`作为参数，返回该字符串的`反转结果`。请编写Junit单元测试来测试该方法的正确性。\n\n> 被测类\n\n```java\npublic class StringUtils {\n    public static String reverse(String str) {\n        if (str == null) {\n            return null;\n        }\n        return new StringBuilder(str).reverse().toString();\n    }\n}\n```\n\n> 测试类\n\n```java\nimport org.junit.Test;\nimport static org.junit.Assert.*;\n\npublic class StringUtilsTest {\n    @Test\n    public void testReverse() {\n        assertEquals(null, StringUtils.reverse(null));\n        assertEquals(\"\", StringUtils.reverse(\"\"));\n        assertEquals(\"a\", StringUtils.reverse(\"a\"));\n        assertEquals(\"ba\", StringUtils.reverse(\"ab\"));\n        assertEquals(\"cba\", StringUtils.reverse(\"abc\"));\n        assertEquals(\"dcba\", StringUtils.reverse(\"abcd\"));\n        assertEquals(\"edcba\", StringUtils.reverse(\"abcde\"));\n    }\n}\n```\n\n### 例题12:请编写一个名为`findMax`的方法，该方法接受一个整数数组作为参数，返回该数组中的最大值。请编写Junit单元测试来测试该方法的正确性\n\n> 被测试类\n\n```java\npublic class ArrayUtils {\n    public static int findMax(int[] arr) {\n        if (arr == null || arr.length == 0) {\n            throw new IllegalArgumentException(\"Array must not be null or empty\");\n        }\n        int max = arr[0];\n        for (int i = 1; i < arr.length; i++) {\n            if (arr[i] > max) {\n                max = arr[i];\n            }\n        }\n        return max;\n    }\n}\n```\n\n> 测试类\n\n```java\nimport org.junit.Test;\nimport static org.junit.Assert.*;\n\npublic class ArrayUtilsTest {\n    @Test\n    public void testFindMax() {\n        assertEquals(5, ArrayUtils.findMax(new int[]{1, 2, 3, 4, 5}));\n        assertEquals(10, ArrayUtils.findMax(new int[]{10, 2, 3, 4, 5}));\n        assertEquals(100, ArrayUtils.findMax(new int[]{1, 2, 3, 4, 100}));\n        assertEquals(5, ArrayUtils.findMax(new int[]{5}));\n        assertEquals(-1, ArrayUtils.findMax(new int[]{-1, -2, -3, -4, -5}));\n        try {\n            ArrayUtils.findMax(null);\n            fail(\"Expected IllegalArgumentException to be thrown\");\n        } catch (IllegalArgumentException e) {\n            assertEquals(\"Array must not be null or empty\", e.getMessage());\n        }\n        try {\n            ArrayUtils.findMax(new int[]{});\n            fail(\"Expected IllegalArgumentException to be thrown\");\n        } catch (IllegalArgumentException e) {\n            assertEquals(\"Array must not be null or empty\", e.getMessage());\n        }\n    }\n}\n```\n\n> 该测试测试了多个数组，包括正数、负数、空数组和长度为1的数组，以确保方法的正确性。我们还测试了方法能否正确地处理空数组和`null`输入。\n\n### 例题13:编写一个单元测试，测试一个方法是否能够正确地判断一个字符串是否为回文字符串。\n\n> 回文字符串:\n>\n> `是指正着读和倒着读都一样的字符串，也就是说，它们在中心对称。例如，\"racecar\"和\"level\"都是回文字符串`\n\n> 被测类\n\n```java\npublic class PalindromeChecker {\n    public boolean isPalindrome(String str) {\n        if (str == null) {\n            return false;\n        }\n        int length = str.length();\n        for (int i = 0; i < length / 2; i++) {\n            if (str.charAt(i) != str.charAt(length - i - 1)) {\n                return false;\n            }\n        }\n        return true;\n    }\n}\n```\n>测试类\n```java\nimport org.junit.Test;\nimport static org.junit.Assert.assertTrue;\nimport static org.junit.Assert.assertFalse;\n\npublic class PalindromeCheckerTest {\n    @Test\n    public void testIsPalindrome() {\n        PalindromeChecker checker = new PalindromeChecker();\n        String palindrome = \"racecar\";\n        String notPalindrome = \"hello\";\n        assertTrue(checker.isPalindrome(palindrome));\n        assertFalse(checker.isPalindrome(notPalindrome));\n    }\n}\n```\n\n### 例题14:编写一个程序，输入一个字符串和一个字符，`统计该字符串中该字符出现的次数`，并返回结果。 要求使用JUnit框架编写测试类对程序进行测试，至少设计3组满足语句覆盖测试的测试数据，在每个测试方法中使用assertThat函数进行断言判断。\n\n> 被测试类\n\n```java\npublic class CharCount {\n\n    public static int count(String str, char ch) {\n        int count = 0;\n        for (int i = 0; i < str.length(); i++) {\n            if (str.charAt(i) == ch) {\n                count++;\n            }\n        }\n        return count;\n    }\n\n}\n```\n\n> 测试类\n\n```java\npublic class CharCountTest {\n\n    @Test\n    public void testEmptyString() {\n        assertThat(CharCount.count(\"\", \'a\'), equalTo(0));\n    }\n\n    @Test\n    public void testSingleCharString() {\n        assertThat(CharCount.count(\"a\", \'a\'), equalTo(1));\n    }\n\n    @Test\n    public void testMultipleCharString() {\n        assertThat(CharCount.count(\"abcaaa\", \'a\'), equalTo(4));\n    }\n\n    @Test\n    public void testNonExistChar() {\n        assertThat(CharCount.count(\"abcd\", \'e\'), equalTo(0));\n    }\n\n    @Test\n    public void testSpaceChar() {\n        assertThat(CharCount.count(\"Hello World!\", \' \'), equalTo(1));\n    }\n\n}\n//分别对空字符串、单字符字符串、多字符字符串、不存在的字符和空格字符进行测试\n```\n\n#### tip:用户名必须以字母开头，由数字、字母和下划线组成，且长度在6-18个字符之间\n\n> 正则:^([a-zA-Z]){1}[0-9a-zA-Z_]{5,17}\n\n### 例题15：编写一个程序，实现对一个字符串中的所有数字进行求和。例如，\"a1b2c3d4\"的结果应该为10。编写JUnit测试类，使用断言测试程序是否能够正确地对字符串中的数字进行求和。使用assertThat中的equalTo()方法进行断言测试\n\n> 被测试类\n\n```java\n// 定义一个方法，接收一个字符串参数\npublic int test03(String str) {\n    // 初始化变量sum为0\n    int sum=0;\n    // 定义一个正则表达式，表示匹配数字\n    String mathmatch=\"\\\\d\";\n    // 创建Pattern对象，用于编译正则表达式\n    Pattern pattern = Pattern.compile(mathmatch);\n    // 创建Matcher对象，用于在指定的字符串中查找匹配的文本\n    Matcher matcher=pattern.matcher(str);\n    // 循环遍历所有匹配结果\n    while (matcher.find()) {\n        // 将匹配结果转换为整数类型\n        int parseInt = Integer.parseInt(matcher.group());\n        // 将匹配结果累加到sum变量中\n        sum+=parseInt;\n    }\n    // 返回统计结果\n    return sum;\n}\n```\n\n', '<h1><a id=\"_0\"></a>单元测试例题</h1>\n<h3><a id=\"1_11__1010OKJUnitassertThatequalTo_2\"></a>例题1：填写快递单时通常需要确定接收人的姓名、手机号和地址。其中要求<mark>手机号是 11 位数字字符</mark>，<mark>地址为字母开头的 10个（含10）以内字母或字母数字共同组成</mark>。填写正确则提示“OK”，否则根据实际情况提示“**不符合要求”（**为手机号或地址）,退出。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足判定覆盖测试，每条测试数据需要在测试类中编写一个测试方法。使用assertThat中equalTo断言判断输出文字期望结果值和实际返回值是否一致。</h3>\n<blockquote>\n<ol>\n<li>编写一个静态方法<code>validate(String name, String phone, String address)</code>，用于验证快递单上的姓名、手机号和地址是否符合要求</li>\n</ol>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ExpressInformationValidator</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> String <span class=\"hljs-title\">validate</span><span class=\"hljs-params\">(String name, String phone, String address)</span> </span>{\n        <span class=\"hljs-comment\">// 验证手机号格式是否正确</span>\n        <span class=\"hljs-keyword\">if</span> (!phone.matches(<span class=\"hljs-string\">\"\\\\d{11}\"</span>)) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"手机号不符合要求\"</span>;\n        }\n        \n        <span class=\"hljs-comment\">// 验证地址格式是否正确</span>\n        <span class=\"hljs-keyword\">if</span> (!address.matches(<span class=\"hljs-string\">\"[a-zA-Z][a-zA-Z0-9]{0,9}\"</span>)) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"地址不符合要求\"</span>;\n        }\n        \n        <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"OK\"</span>;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>2.编写一个测试类<code>ExpressInformationValidatorTest</code>，使用JUnit框架对<code>ExpressInformationValidator</code>类中的方法进行测试</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.Test;\n\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.hamcrest.CoreMatchers.equalTo;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertThat;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ExpressInformationValidatorTest</span> </span>{\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testValidInformation</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(ExpressInformationValidator.validate(<span class=\"hljs-string\">\"张三\"</span>, <span class=\"hljs-string\">\"13888888888\"</span>, <span class=\"hljs-string\">\"A123Bcdefg\"</span>), equalTo(<span class=\"hljs-string\">\"OK\"</span>));\n        assertThat(ExpressInformationValidator.validate(<span class=\"hljs-string\">\"李四\"</span>, <span class=\"hljs-string\">\"13999999999\"</span>, <span class=\"hljs-string\">\"AbcdeFGHIJ\"</span>), equalTo(<span class=\"hljs-string\">\"OK\"</span>));\n    }\n    \n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testInvalidPhoneNumber</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(ExpressInformationValidator.validate(<span class=\"hljs-string\">\"王五\"</span>, <span class=\"hljs-string\">\"1234567890\"</span>, <span class=\"hljs-string\">\"A1bcdefghi\"</span>), equalTo(<span class=\"hljs-string\">\"手机号不符合要求\"</span>));\n        assertThat(ExpressInformationValidator.validate(<span class=\"hljs-string\">\"赵六\"</span>, <span class=\"hljs-string\">\"13888888a8\"</span>, <span class=\"hljs-string\">\"A1bcdefghi\"</span>), equalTo(<span class=\"hljs-string\">\"手机号不符合要求\"</span>));\n    }\n    \n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testInvalidAddress</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(ExpressInformationValidator.validate(<span class=\"hljs-string\">\"孙七\"</span>, <span class=\"hljs-string\">\"13777777777\"</span>, <span class=\"hljs-string\">\"123ABcdefg\"</span>), equalTo(<span class=\"hljs-string\">\"地址不符合要求\"</span>));\n        assertThat(ExpressInformationValidator.validate(<span class=\"hljs-string\">\"周八\"</span>, <span class=\"hljs-string\">\"13666666666\"</span>, <span class=\"hljs-string\">\"AbcdeFGHIJK\"</span>), equalTo(<span class=\"hljs-string\">\"地址不符合要求\"</span>));\n    }\n}\n</code></div></pre>\n<h3><a id=\"2_53\"></a>例题2：测试一个字符串是否为空</h3>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">StringUtils</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">boolean</span> <span class=\"hljs-title\">isEmpty</span><span class=\"hljs-params\">(String str)</span> </span>{\n        <span class=\"hljs-keyword\">return</span> str == <span class=\"hljs-keyword\">null</span> || str.isEmpty();\n    }\n}\n\n<span class=\"hljs-meta\">@Test</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testEmptyString</span><span class=\"hljs-params\">()</span> </span>{\n    StringUtils stringUtils = <span class=\"hljs-keyword\">new</span> StringUtils();\n    String str = <span class=\"hljs-string\">\"\"</span>;\n    assertTrue(stringUtils.isEmpty(str));\n}\n</code></div></pre>\n<h3><a id=\"3_70\"></a>例题3：测试一个字符串是否包含另一个字符串</h3>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">StringUtils</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">boolean</span> <span class=\"hljs-title\">contains</span><span class=\"hljs-params\">(String str, String subStr)</span> </span>{\n        <span class=\"hljs-keyword\">return</span> str.contains(subStr);\n    }\n}\n\n<span class=\"hljs-meta\">@Test</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testStringContains</span><span class=\"hljs-params\">()</span> </span>{\n    StringUtils stringUtils = <span class=\"hljs-keyword\">new</span> StringUtils();\n    String str = <span class=\"hljs-string\">\"Hello, world!\"</span>;\n    String subStr = <span class=\"hljs-string\">\"world\"</span>;\n    assertTrue(stringUtils.contains(str, subStr));\n}\n</code></div></pre>\n<h3><a id=\"4_88\"></a>例题4:测试一个日期是否为闰年</h3>\n<blockquote>\n<p>编写一个名为DateUtils的被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">DateUtils</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">boolean</span> <span class=\"hljs-title\">isLeapYear</span><span class=\"hljs-params\">(<span class=\"hljs-keyword\">int</span> year)</span> </span>{\n        <span class=\"hljs-keyword\">if</span> (year % <span class=\"hljs-number\">4</span> == <span class=\"hljs-number\">0</span> &amp;&amp; year % <span class=\"hljs-number\">100</span> != <span class=\"hljs-number\">0</span> || year % <span class=\"hljs-number\">400</span> == <span class=\"hljs-number\">0</span>) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">true</span>;\n        }\n        <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">false</span>;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>编写一个testLeapYear的测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-meta\">@Test</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testLeapYear</span><span class=\"hljs-params\">()</span> </span>{\n    DateUtils dateUtils = <span class=\"hljs-keyword\">new</span> DateUtils();\n	<span class=\"hljs-keyword\">int</span> year = <span class=\"hljs-number\">2020</span>;\n	assertTrue(dateUtils.isLeapYear(year));\n}\n</code></div></pre>\n<h3><a id=\"522222yearmonthdaysyearmonthdaysyearmonthJUnitassertThatequalTo_114\"></a>例题5:<mark>根据输入的年份和月份判断月份的天数</mark>。若<mark>月份不在有效范围之内，应提示：“月份输入不正确。”</mark>。<mark>月份不为2月，根据输入月份输出对应的月份天数</mark>。月份为2月，根据年份判断如为普通闰年，输出2月份正确天数；如为世纪闰年，输出2月份正确天数；不为闰年输出2月份天数。返回结果格式：==“year年month月份的天数是days天。”==year、month为传入的值，days为判断得到的天数值。其中变量year、month均须为正整数。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足语句覆盖测试，每条测试数据需要在测试类中编写一个测试方法。使用assertThat中equalTo断言判断返回期望结果和实际返回是否一致。</h3>\n<blockquote>\n<p>被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">MonthDays</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> String <span class=\"hljs-title\">getMonthDays</span><span class=\"hljs-params\">(<span class=\"hljs-keyword\">int</span> year, <span class=\"hljs-keyword\">int</span> month)</span> </span>{\n        <span class=\"hljs-keyword\">int</span> days = <span class=\"hljs-number\">0</span>;\n        <span class=\"hljs-keyword\">if</span> (month &lt; <span class=\"hljs-number\">1</span> || month &gt; <span class=\"hljs-number\">12</span>) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"月份输入不正确。\"</span>;\n        } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (month != <span class=\"hljs-number\">2</span>) {\n            <span class=\"hljs-keyword\">switch</span> (month) {\n                <span class=\"hljs-keyword\">case</span> <span class=\"hljs-number\">4</span>:\n                <span class=\"hljs-keyword\">case</span> <span class=\"hljs-number\">6</span>:\n                <span class=\"hljs-keyword\">case</span> <span class=\"hljs-number\">9</span>:\n                <span class=\"hljs-keyword\">case</span> <span class=\"hljs-number\">11</span>:\n                    days = <span class=\"hljs-number\">30</span>;\n                    <span class=\"hljs-keyword\">break</span>;\n                <span class=\"hljs-keyword\">default</span>:\n                    days = <span class=\"hljs-number\">31</span>;\n                    <span class=\"hljs-keyword\">break</span>;\n            }\n        } <span class=\"hljs-keyword\">else</span> {\n            <span class=\"hljs-keyword\">if</span> (year % <span class=\"hljs-number\">4</span> == <span class=\"hljs-number\">0</span> &amp;&amp; year % <span class=\"hljs-number\">100</span> != <span class=\"hljs-number\">0</span> || year % <span class=\"hljs-number\">400</span> == <span class=\"hljs-number\">0</span>) {\n                days = <span class=\"hljs-number\">29</span>;\n            } <span class=\"hljs-keyword\">else</span> {\n                days = <span class=\"hljs-number\">28</span>;\n            }\n        }\n        <span class=\"hljs-keyword\">return</span> year + <span class=\"hljs-string\">\"年\"</span> + month + <span class=\"hljs-string\">\"月份的天数是\"</span> + days + <span class=\"hljs-string\">\"天。\"</span>;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.hamcrest.CoreMatchers.equalTo;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertThat;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">MonthDaysTest</span> </span>{\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testMonthDays1</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(MonthDays.getMonthDays(<span class=\"hljs-number\">2022</span>, <span class=\"hljs-number\">2</span>), equalTo(<span class=\"hljs-string\">\"2022年2月份的天数是28天。\"</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testMonthDays2</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(MonthDays.getMonthDays(<span class=\"hljs-number\">2022</span>, <span class=\"hljs-number\">4</span>), equalTo(<span class=\"hljs-string\">\"2022年4月份的天数是30天。\"</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testMonthDays3</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(MonthDays.getMonthDays(<span class=\"hljs-number\">2022</span>, <span class=\"hljs-number\">12</span>), equalTo(<span class=\"hljs-string\">\"2022年12月份的天数是31天。\"</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testMonthDays4</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(MonthDays.getMonthDays(<span class=\"hljs-number\">2022</span>, <span class=\"hljs-number\">0</span>), equalTo(<span class=\"hljs-string\">\"月份输入不正确。\"</span>));\n    }\n}\n</code></div></pre>\n<h3><a id=\"6ababefcdabcdghcdJUnitParametersassertEquals_178\"></a>例题6:<code>输入小写的字符串</code>。<code>如字符串前缀为ab开头，则将前缀ab替换为ef并打印出替换后字符串，返回文字“替换前缀后的字符串为:”和替换后字符串值</code>；如<code>后缀为cd并且前缀不为ab</code>，替换字符串中<code>所有cd为gh</code>并打印出替换后字符串，返回文字<code>“替换cd后的字符串为:”和替换后字符串值</code>;否则全部字母大写输出，返回文字“大写字母的字符串为:”和转换后的字符串值。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足条件覆盖测试，测试类<mark>使用参数化测试（@Parameters）完成测试</mark>。使用assertEquals判断期望结果值和实际返回值是否一致</h3>\n<blockquote>\n<p>被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">StringReplace</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> String <span class=\"hljs-title\">replaceString</span><span class=\"hljs-params\">(String str)</span> </span>{\n        <span class=\"hljs-keyword\">if</span> (str.startsWith(<span class=\"hljs-string\">\"ab\"</span>)) {\n            String newStr = str.replaceFirst(<span class=\"hljs-string\">\"ab\"</span>, <span class=\"hljs-string\">\"ef\"</span>);\n            System.out.println(<span class=\"hljs-string\">\"替换前缀后的字符串为：\"</span> + newStr);\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"替换前缀后的字符串为：\"</span> + newStr;\n        } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (str.endsWith(<span class=\"hljs-string\">\"cd\"</span>) &amp;&amp; !str.startsWith(<span class=\"hljs-string\">\"ab\"</span>)) {\n            String newStr = str.replaceAll(<span class=\"hljs-string\">\"cd\"</span>, <span class=\"hljs-string\">\"gh\"</span>);\n            System.out.println(<span class=\"hljs-string\">\"替换cd后的字符串为：\"</span> + newStr);\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"替换cd后的字符串为：\"</span> + newStr;\n        } <span class=\"hljs-keyword\">else</span> {\n            String newStr = str.toUpperCase();\n            System.out.println(<span class=\"hljs-string\">\"大写字母的字符串为：\"</span> + newStr);\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"大写字母的字符串为：\"</span> + newStr;\n        }\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类,使用参数化测试</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> java.util.Arrays;\n<span class=\"hljs-keyword\">import</span> java.util.Collection;\n\n<span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> org.junit.runner.RunWith;\n<span class=\"hljs-keyword\">import</span> org.junit.runners.Parameterized;\n<span class=\"hljs-keyword\">import</span> org.junit.runners.Parameterized.Parameters;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertEquals;\n\n<span class=\"hljs-meta\">@RunWith</span>(Parameterized.class)\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">StringReplaceTest</span> </span>{\n    <span class=\"hljs-keyword\">private</span> String input;\n    <span class=\"hljs-keyword\">private</span> String expectedOutput;\n\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-title\">StringReplaceTest</span><span class=\"hljs-params\">(String input, String expectedOutput)</span> </span>{\n        <span class=\"hljs-keyword\">this</span>.input = input;\n        <span class=\"hljs-keyword\">this</span>.expectedOutput = expectedOutput;\n    }\n\n    <span class=\"hljs-meta\">@Parameterized</span>.Parameters\n    <span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> Collection&lt;Object[]&gt; data() {\n        <span class=\"hljs-keyword\">return</span> Arrays.asList(<span class=\"hljs-keyword\">new</span> Object[][]{\n                {<span class=\"hljs-string\">\"abcdef\"</span>, <span class=\"hljs-string\">\"替换前缀后的字符串为：efcdef\"</span>},\n                {<span class=\"hljs-string\">\"abxyz\"</span>, <span class=\"hljs-string\">\"替换前缀后的字符串为：efxyz\"</span>},\n                {<span class=\"hljs-string\">\"cdxyz\"</span>, <span class=\"hljs-string\">\"替换cd后的字符串为：ghxyz\"</span>},\n                {<span class=\"hljs-string\">\"abcd\"</span>, <span class=\"hljs-string\">\"替换前缀后的字符串为：efcd\"</span>},\n                {<span class=\"hljs-string\">\"ab\"</span>, <span class=\"hljs-string\">\"替换前缀后的字符串为：ef\"</span>},\n                {<span class=\"hljs-string\">\"cdef\"</span>, <span class=\"hljs-string\">\"大写字母的字符串为：CDEF\"</span>},\n                {<span class=\"hljs-string\">\"ABCDEF\"</span>, <span class=\"hljs-string\">\"大写字母的字符串为：ABCDEF\"</span>},\n                {<span class=\"hljs-string\">\"\"</span>, <span class=\"hljs-string\">\"大写字母的字符串为：\"</span>}\n        });\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testReplaceString</span><span class=\"hljs-params\">()</span> </span>{\n        assertEquals(expectedOutput, StringReplace.replaceString(input));\n    }\n}\n</code></div></pre>\n<h3><a id=\"752163126comcomcn66JUnitassertThatequalTo_245\"></a>例题7:邮箱注册需要填写邮箱地址和密码。其中要求<code>邮箱格式“登录名@主机名.域名”</code>，<code>登录名为5个字母</code>，<code>主机名固定为下面2个163、126，域名为com或com.cn。密码为6个（含6）以上数字组成</code>。填写正确则提示“信息正确”，否则根据实际情况提示“**不符合要求”（**为邮箱地址或密码）。编写程序代码，使用JUnit框架编写测试类对编写的程序代码进行测试，测试类中设计最少的测试数据满足语句覆盖测试，每条测试数据需要在测试类中编写一个测试方法。使用assertThat中equalTo断言判断输出文字期望结果值和实际返回值是否一致。</h3>\n<blockquote>\n<p>被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">EmailRegister</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> String <span class=\"hljs-title\">checkEmail</span><span class=\"hljs-params\">(String email, String password)</span> </span>{\n        String regex = <span class=\"hljs-string\">\"[a-zA-Z]{5}@(163|126)\\\\.(com|com\\\\.cn)\"</span>;\n        String regexPassword = <span class=\"hljs-string\">\"\\\\d{6,}\"</span>;\n        <span class=\"hljs-keyword\">if</span> (email.matches(regex) &amp;&amp; password.matches(regexPassword)) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"信息正确\"</span>;\n        } <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (!email.matches(regex)) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"邮箱地址不符合要求\"</span>;\n        } <span class=\"hljs-keyword\">else</span> {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"密码不符合要求\"</span>;\n        }\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.hamcrest.CoreMatchers.equalTo;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertThat;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">EmailRegisterTest</span> </span>{\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testCheckEmail</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(EmailRegister.checkEmail(<span class=\"hljs-string\">\"abcde@163.com\"</span>, <span class=\"hljs-string\">\"123456\"</span>), equalTo(<span class=\"hljs-string\">\"信息正确\"</span>));\n        assertThat(EmailRegister.checkEmail(<span class=\"hljs-string\">\"abcde@126.com.cn\"</span>, <span class=\"hljs-string\">\"123456\"</span>), equalTo(<span class=\"hljs-string\">\"信息正确\"</span>));\n        assertThat(EmailRegister.checkEmail(<span class=\"hljs-string\">\"abcde@163.com.cn\"</span>, <span class=\"hljs-string\">\"123456\"</span>), equalTo(<span class=\"hljs-string\">\"邮箱地址不符合要求\"</span>));\n        assertThat(EmailRegister.checkEmail(<span class=\"hljs-string\">\"abcde@126.com\"</span>, <span class=\"hljs-string\">\"12345\"</span>), equalTo(<span class=\"hljs-string\">\"密码不符合要求\"</span>));\n        assertThat(EmailRegister.checkEmail(<span class=\"hljs-string\">\"abcde@163.com\"</span>, <span class=\"hljs-string\">\"12345a\"</span>), equalTo(<span class=\"hljs-string\">\"密码不符合要求\"</span>));\n    }\n}\n</code></div></pre>\n<h3><a id=\"8_284\"></a>例题8：请编写一个程序，<code>实现一个简单的计算器功能</code>，支持加、减、乘、除四种运算。程序接受两个整数作为输入，根据用户输入的运算符进行相应的运算，并输出结果。如果用户输入的运算符不是加、减、乘、除中的一种，则输出&quot;运算符不合法&quot;。、</h3>\n<blockquote>\n<p>被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Calculator</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">calculate</span><span class=\"hljs-params\">(<span class=\"hljs-keyword\">int</span> a, <span class=\"hljs-keyword\">int</span> b, String operator)</span> </span>{\n        <span class=\"hljs-keyword\">int</span> result = <span class=\"hljs-number\">0</span>;\n        <span class=\"hljs-keyword\">switch</span> (operator) {\n            <span class=\"hljs-keyword\">case</span> <span class=\"hljs-string\">\"+\"</span>:\n                result = a + b;\n                <span class=\"hljs-keyword\">break</span>;\n            <span class=\"hljs-keyword\">case</span> <span class=\"hljs-string\">\"-\"</span>:\n                result = a - b;\n                <span class=\"hljs-keyword\">break</span>;\n            <span class=\"hljs-keyword\">case</span> <span class=\"hljs-string\">\"*\"</span>:\n                result = a * b;\n                <span class=\"hljs-keyword\">break</span>;\n            <span class=\"hljs-keyword\">case</span> <span class=\"hljs-string\">\"/\"</span>:\n                <span class=\"hljs-keyword\">if</span> (b == <span class=\"hljs-number\">0</span>) {\n                    <span class=\"hljs-keyword\">throw</span> <span class=\"hljs-keyword\">new</span> IllegalArgumentException(<span class=\"hljs-string\">\"除数不能为0\"</span>);\n                }\n                result = a / b;\n                <span class=\"hljs-keyword\">break</span>;\n            <span class=\"hljs-keyword\">default</span>:\n                <span class=\"hljs-keyword\">throw</span> <span class=\"hljs-keyword\">new</span> IllegalArgumentException(<span class=\"hljs-string\">\"运算符不合法\"</span>);\n        }\n        <span class=\"hljs-keyword\">return</span> result;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.After;\n<span class=\"hljs-keyword\">import</span> org.junit.Before;\n<span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.hamcrest.CoreMatchers.equalTo;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertThat;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">CalculatorTest</span> </span>{\n    <span class=\"hljs-keyword\">private</span> Calculator calculator;\n\n    <span class=\"hljs-meta\">@Before</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">setUp</span><span class=\"hljs-params\">()</span> </span>{\n        calculator = <span class=\"hljs-keyword\">new</span> Calculator();\n    }\n\n    <span class=\"hljs-meta\">@After</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">tearDown</span><span class=\"hljs-params\">()</span> </span>{\n        calculator = <span class=\"hljs-keyword\">null</span>;\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testAdd</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(calculator.calculate(<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-string\">\"+\"</span>), equalTo(<span class=\"hljs-number\">3</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testSubtract</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(calculator.calculate(<span class=\"hljs-number\">3</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-string\">\"-\"</span>), equalTo(<span class=\"hljs-number\">1</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testMultiply</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(calculator.calculate(<span class=\"hljs-number\">2</span>, <span class=\"hljs-number\">3</span>, <span class=\"hljs-string\">\"*\"</span>), equalTo(<span class=\"hljs-number\">6</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testDivide</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(calculator.calculate(<span class=\"hljs-number\">6</span>, <span class=\"hljs-number\">3</span>, <span class=\"hljs-string\">\"/\"</span>), equalTo(<span class=\"hljs-number\">2</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>(expected = IllegalArgumentException.class)\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testDivideByZero</span><span class=\"hljs-params\">()</span> </span>{\n        calculator.calculate(<span class=\"hljs-number\">6</span>, <span class=\"hljs-number\">0</span>, <span class=\"hljs-string\">\"/\"</span>);\n    }\n\n    <span class=\"hljs-meta\">@Test</span>(expected = IllegalArgumentException.class)\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testInvalidOperator</span><span class=\"hljs-params\">()</span> </span>{\n        calculator.calculate(<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-string\">\"invalid\"</span>);\n    }\n}\n</code></div></pre>\n<h3><a id=\"9_370\"></a>例题9:请编写一个程序，实现<code>一个简单的加法功能</code>。程序接受两个整数作为输入，返回它们的<code>和</code>。(<code>使用参数化</code>)</h3>\n<blockquote>\n<p>被测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Calculator</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">add</span><span class=\"hljs-params\">(<span class=\"hljs-keyword\">int</span> a, <span class=\"hljs-keyword\">int</span> b)</span> </span>{\n        <span class=\"hljs-keyword\">return</span> a + b;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.After;\n<span class=\"hljs-keyword\">import</span> org.junit.Before;\n<span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> org.junit.runner.RunWith;\n<span class=\"hljs-keyword\">import</span> org.junit.runners.Parameterized;\n<span class=\"hljs-keyword\">import</span> java.util.Arrays;\n<span class=\"hljs-keyword\">import</span> java.util.Collection;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.hamcrest.CoreMatchers.equalTo;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertThat;\n\n<span class=\"hljs-meta\">@RunWith</span>(Parameterized.class)\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">CalculatorTest</span> </span>{\n    <span class=\"hljs-keyword\">private</span> Calculator calculator;\n    <span class=\"hljs-keyword\">private</span> <span class=\"hljs-keyword\">int</span> a;\n    <span class=\"hljs-keyword\">private</span> <span class=\"hljs-keyword\">int</span> b;\n    <span class=\"hljs-keyword\">private</span> <span class=\"hljs-keyword\">int</span> expected;\n\n    <span class=\"hljs-meta\">@Before</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">setUp</span><span class=\"hljs-params\">()</span> </span>{\n        calculator = <span class=\"hljs-keyword\">new</span> Calculator();\n    }\n\n    <span class=\"hljs-meta\">@After</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">tearDown</span><span class=\"hljs-params\">()</span> </span>{\n        calculator = <span class=\"hljs-keyword\">null</span>;\n    }\n\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-title\">CalculatorTest</span><span class=\"hljs-params\">(<span class=\"hljs-keyword\">int</span> a, <span class=\"hljs-keyword\">int</span> b, <span class=\"hljs-keyword\">int</span> expected)</span> </span>{\n        <span class=\"hljs-keyword\">this</span>.a = a;\n        <span class=\"hljs-keyword\">this</span>.b = b;\n        <span class=\"hljs-keyword\">this</span>.expected = expected;\n    }\n\n    <span class=\"hljs-meta\">@Parameterized</span>.Parameters\n    <span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> Collection&lt;Object[]&gt; data() {\n        <span class=\"hljs-keyword\">return</span> Arrays.asList(<span class=\"hljs-keyword\">new</span> Object[][] {\n                { <span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-number\">3</span> },\n                { -<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">0</span> },\n                { <span class=\"hljs-number\">0</span>, <span class=\"hljs-number\">0</span>, <span class=\"hljs-number\">0</span> },\n                { Integer.MAX_VALUE, <span class=\"hljs-number\">1</span>, Integer.MIN_VALUE },\n                { Integer.MIN_VALUE, -<span class=\"hljs-number\">1</span>, Integer.MAX_VALUE },\n        });\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testAdd</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(calculator.add(a, b), equalTo(expected));\n    }\n}\n</code></div></pre>\n<h3><a id=\"10isPrimetruefalseJunit_436\"></a>例题10：请编写一个名为<code>isPrime</code>的方法，该方法接受一个整数作为参数，如果该整数是<code>质数</code>，则返回<code>true</code>，否则返回<code>false</code>。请编写Junit单元测试来测试该方法的正确性</h3>\n<blockquote>\n<p><strong>质数</strong>（Prime number），又称<a href=\"https://so.csdn.net/so/search?q=%E7%B4%A0%E6%95%B0&amp;spm=1001.2101.3001.7020\" target=\"_blank\">素数</a>，指在大于1的自然数中，除了1和该数自身外，<strong>无法被其他自然数整除</strong>的数。（也可定义为只有1与该数本身两个正因数的数）</p>\n</blockquote>\n<blockquote>\n<p>被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">PrimeChecker</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> <span class=\"hljs-keyword\">boolean</span> <span class=\"hljs-title\">isPrime</span><span class=\"hljs-params\">(<span class=\"hljs-keyword\">int</span> number)</span> </span>{\n        <span class=\"hljs-keyword\">if</span> (number &lt; <span class=\"hljs-number\">2</span>) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">false</span>;\n        }\n        <span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">int</span> i = <span class=\"hljs-number\">2</span>; i &lt;= Math.sqrt(number); i++) {\n            <span class=\"hljs-keyword\">if</span> (number % i == <span class=\"hljs-number\">0</span>) {\n                <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">false</span>;\n            }\n        }\n        <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">true</span>;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.*;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">PrimeCheckerTest</span> </span>{\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testIsPrime</span><span class=\"hljs-params\">()</span> </span>{\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">2</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">3</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">5</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">7</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">11</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">13</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">17</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">19</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">23</span>));\n        assertTrue(PrimeChecker.isPrime(<span class=\"hljs-number\">29</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">1</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">4</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">6</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">8</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">9</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">10</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">12</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">14</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">15</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">16</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">18</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">20</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">21</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">22</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">24</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">25</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">26</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">27</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">28</span>));\n        assertFalse(PrimeChecker.isPrime(<span class=\"hljs-number\">30</span>));\n    }\n}\n</code></div></pre>\n<h3><a id=\"11reverseJunit_501\"></a>例题11:请编写一个名为reverse的方法，该方法接受一个<code>字符串</code>作为参数，返回该字符串的<code>反转结果</code>。请编写Junit单元测试来测试该方法的正确性。</h3>\n<blockquote>\n<p>被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">StringUtils</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> String <span class=\"hljs-title\">reverse</span><span class=\"hljs-params\">(String str)</span> </span>{\n        <span class=\"hljs-keyword\">if</span> (str == <span class=\"hljs-keyword\">null</span>) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">null</span>;\n        }\n        <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">new</span> StringBuilder(str).reverse().toString();\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.*;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">StringUtilsTest</span> </span>{\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testReverse</span><span class=\"hljs-params\">()</span> </span>{\n        assertEquals(<span class=\"hljs-keyword\">null</span>, StringUtils.reverse(<span class=\"hljs-keyword\">null</span>));\n        assertEquals(<span class=\"hljs-string\">\"\"</span>, StringUtils.reverse(<span class=\"hljs-string\">\"\"</span>));\n        assertEquals(<span class=\"hljs-string\">\"a\"</span>, StringUtils.reverse(<span class=\"hljs-string\">\"a\"</span>));\n        assertEquals(<span class=\"hljs-string\">\"ba\"</span>, StringUtils.reverse(<span class=\"hljs-string\">\"ab\"</span>));\n        assertEquals(<span class=\"hljs-string\">\"cba\"</span>, StringUtils.reverse(<span class=\"hljs-string\">\"abc\"</span>));\n        assertEquals(<span class=\"hljs-string\">\"dcba\"</span>, StringUtils.reverse(<span class=\"hljs-string\">\"abcd\"</span>));\n        assertEquals(<span class=\"hljs-string\">\"edcba\"</span>, StringUtils.reverse(<span class=\"hljs-string\">\"abcde\"</span>));\n    }\n}\n</code></div></pre>\n<h3><a id=\"12findMaxJunit_536\"></a>例题12:请编写一个名为<code>findMax</code>的方法，该方法接受一个整数数组作为参数，返回该数组中的最大值。请编写Junit单元测试来测试该方法的正确性</h3>\n<blockquote>\n<p>被测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ArrayUtils</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> <span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">findMax</span><span class=\"hljs-params\">(<span class=\"hljs-keyword\">int</span>[] arr)</span> </span>{\n        <span class=\"hljs-keyword\">if</span> (arr == <span class=\"hljs-keyword\">null</span> || arr.length == <span class=\"hljs-number\">0</span>) {\n            <span class=\"hljs-keyword\">throw</span> <span class=\"hljs-keyword\">new</span> IllegalArgumentException(<span class=\"hljs-string\">\"Array must not be null or empty\"</span>);\n        }\n        <span class=\"hljs-keyword\">int</span> max = arr[<span class=\"hljs-number\">0</span>];\n        <span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">int</span> i = <span class=\"hljs-number\">1</span>; i &lt; arr.length; i++) {\n            <span class=\"hljs-keyword\">if</span> (arr[i] &gt; max) {\n                max = arr[i];\n            }\n        }\n        <span class=\"hljs-keyword\">return</span> max;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.*;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ArrayUtilsTest</span> </span>{\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testFindMax</span><span class=\"hljs-params\">()</span> </span>{\n        assertEquals(<span class=\"hljs-number\">5</span>, ArrayUtils.findMax(<span class=\"hljs-keyword\">new</span> <span class=\"hljs-keyword\">int</span>[]{<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-number\">3</span>, <span class=\"hljs-number\">4</span>, <span class=\"hljs-number\">5</span>}));\n        assertEquals(<span class=\"hljs-number\">10</span>, ArrayUtils.findMax(<span class=\"hljs-keyword\">new</span> <span class=\"hljs-keyword\">int</span>[]{<span class=\"hljs-number\">10</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-number\">3</span>, <span class=\"hljs-number\">4</span>, <span class=\"hljs-number\">5</span>}));\n        assertEquals(<span class=\"hljs-number\">100</span>, ArrayUtils.findMax(<span class=\"hljs-keyword\">new</span> <span class=\"hljs-keyword\">int</span>[]{<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-number\">3</span>, <span class=\"hljs-number\">4</span>, <span class=\"hljs-number\">100</span>}));\n        assertEquals(<span class=\"hljs-number\">5</span>, ArrayUtils.findMax(<span class=\"hljs-keyword\">new</span> <span class=\"hljs-keyword\">int</span>[]{<span class=\"hljs-number\">5</span>}));\n        assertEquals(-<span class=\"hljs-number\">1</span>, ArrayUtils.findMax(<span class=\"hljs-keyword\">new</span> <span class=\"hljs-keyword\">int</span>[]{-<span class=\"hljs-number\">1</span>, -<span class=\"hljs-number\">2</span>, -<span class=\"hljs-number\">3</span>, -<span class=\"hljs-number\">4</span>, -<span class=\"hljs-number\">5</span>}));\n        <span class=\"hljs-keyword\">try</span> {\n            ArrayUtils.findMax(<span class=\"hljs-keyword\">null</span>);\n            fail(<span class=\"hljs-string\">\"Expected IllegalArgumentException to be thrown\"</span>);\n        } <span class=\"hljs-keyword\">catch</span> (IllegalArgumentException e) {\n            assertEquals(<span class=\"hljs-string\">\"Array must not be null or empty\"</span>, e.getMessage());\n        }\n        <span class=\"hljs-keyword\">try</span> {\n            ArrayUtils.findMax(<span class=\"hljs-keyword\">new</span> <span class=\"hljs-keyword\">int</span>[]{});\n            fail(<span class=\"hljs-string\">\"Expected IllegalArgumentException to be thrown\"</span>);\n        } <span class=\"hljs-keyword\">catch</span> (IllegalArgumentException e) {\n            assertEquals(<span class=\"hljs-string\">\"Array must not be null or empty\"</span>, e.getMessage());\n        }\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>该测试测试了多个数组，包括正数、负数、空数组和长度为1的数组，以确保方法的正确性。我们还测试了方法能否正确地处理空数组和<code>null</code>输入。</p>\n</blockquote>\n<h3><a id=\"13_589\"></a>例题13:编写一个单元测试，测试一个方法是否能够正确地判断一个字符串是否为回文字符串。</h3>\n<blockquote>\n<p>回文字符串:</p>\n<p><code>是指正着读和倒着读都一样的字符串，也就是说，它们在中心对称。例如，&quot;racecar&quot;和&quot;level&quot;都是回文字符串</code></p>\n</blockquote>\n<blockquote>\n<p>被测类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">PalindromeChecker</span> </span>{\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">boolean</span> <span class=\"hljs-title\">isPalindrome</span><span class=\"hljs-params\">(String str)</span> </span>{\n        <span class=\"hljs-keyword\">if</span> (str == <span class=\"hljs-keyword\">null</span>) {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">false</span>;\n        }\n        <span class=\"hljs-keyword\">int</span> length = str.length();\n        <span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">int</span> i = <span class=\"hljs-number\">0</span>; i &lt; length / <span class=\"hljs-number\">2</span>; i++) {\n            <span class=\"hljs-keyword\">if</span> (str.charAt(i) != str.charAt(length - i - <span class=\"hljs-number\">1</span>)) {\n                <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">false</span>;\n            }\n        }\n        <span class=\"hljs-keyword\">return</span> <span class=\"hljs-keyword\">true</span>;\n    }\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">import</span> org.junit.Test;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertTrue;\n<span class=\"hljs-keyword\">import</span> <span class=\"hljs-keyword\">static</span> org.junit.Assert.assertFalse;\n\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">PalindromeCheckerTest</span> </span>{\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testIsPalindrome</span><span class=\"hljs-params\">()</span> </span>{\n        PalindromeChecker checker = <span class=\"hljs-keyword\">new</span> PalindromeChecker();\n        String palindrome = <span class=\"hljs-string\">\"racecar\"</span>;\n        String notPalindrome = <span class=\"hljs-string\">\"hello\"</span>;\n        assertTrue(checker.isPalindrome(palindrome));\n        assertFalse(checker.isPalindrome(notPalindrome));\n    }\n}\n</code></div></pre>\n<h3><a id=\"14_JUnit3assertThat_631\"></a>例题14:编写一个程序，输入一个字符串和一个字符，<code>统计该字符串中该字符出现的次数</code>，并返回结果。 要求使用JUnit框架编写测试类对程序进行测试，至少设计3组满足语句覆盖测试的测试数据，在每个测试方法中使用assertThat函数进行断言判断。</h3>\n<blockquote>\n<p>被测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">CharCount</span> </span>{\n\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">static</span> <span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">count</span><span class=\"hljs-params\">(String str, <span class=\"hljs-keyword\">char</span> ch)</span> </span>{\n        <span class=\"hljs-keyword\">int</span> count = <span class=\"hljs-number\">0</span>;\n        <span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">int</span> i = <span class=\"hljs-number\">0</span>; i &lt; str.length(); i++) {\n            <span class=\"hljs-keyword\">if</span> (str.charAt(i) == ch) {\n                count++;\n            }\n        }\n        <span class=\"hljs-keyword\">return</span> count;\n    }\n\n}\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">CharCountTest</span> </span>{\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testEmptyString</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(CharCount.count(<span class=\"hljs-string\">\"\"</span>, <span class=\"hljs-string\">\'a\'</span>), equalTo(<span class=\"hljs-number\">0</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testSingleCharString</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(CharCount.count(<span class=\"hljs-string\">\"a\"</span>, <span class=\"hljs-string\">\'a\'</span>), equalTo(<span class=\"hljs-number\">1</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testMultipleCharString</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(CharCount.count(<span class=\"hljs-string\">\"abcaaa\"</span>, <span class=\"hljs-string\">\'a\'</span>), equalTo(<span class=\"hljs-number\">4</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testNonExistChar</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(CharCount.count(<span class=\"hljs-string\">\"abcd\"</span>, <span class=\"hljs-string\">\'e\'</span>), equalTo(<span class=\"hljs-number\">0</span>));\n    }\n\n    <span class=\"hljs-meta\">@Test</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testSpaceChar</span><span class=\"hljs-params\">()</span> </span>{\n        assertThat(CharCount.count(<span class=\"hljs-string\">\"Hello World!\"</span>, <span class=\"hljs-string\">\' \'</span>), equalTo(<span class=\"hljs-number\">1</span>));\n    }\n\n}\n<span class=\"hljs-comment\">//分别对空字符串、单字符字符串、多字符字符串、不存在的字符和空格字符进行测试</span>\n</code></div></pre>\n<h4><a id=\"tip618_685\"></a>tip:用户名必须以字母开头，由数字、字母和下划线组成，且长度在6-18个字符之间</h4>\n<blockquote>\n<p>正则:^([a-zA-Z]){1}[0-9a-zA-Z_]{5,17}</p>\n</blockquote>\n<h3><a id=\"15a1b2c3d410JUnitassertThatequalTo_689\"></a>例题15：编写一个程序，实现对一个字符串中的所有数字进行求和。例如，&quot;a1b2c3d4&quot;的结果应该为10。编写JUnit测试类，使用断言测试程序是否能够正确地对字符串中的数字进行求和。使用assertThat中的equalTo()方法进行断言测试</h3>\n<blockquote>\n<p>被测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-comment\">// 定义一个方法，接收一个字符串参数</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">test03</span><span class=\"hljs-params\">(String str)</span> </span>{\n    <span class=\"hljs-comment\">// 初始化变量sum为0</span>\n    <span class=\"hljs-keyword\">int</span> sum=<span class=\"hljs-number\">0</span>;\n    <span class=\"hljs-comment\">// 定义一个正则表达式，表示匹配数字</span>\n    String mathmatch=<span class=\"hljs-string\">\"\\\\d\"</span>;\n    <span class=\"hljs-comment\">// 创建Pattern对象，用于编译正则表达式</span>\n    Pattern pattern = Pattern.compile(mathmatch);\n    <span class=\"hljs-comment\">// 创建Matcher对象，用于在指定的字符串中查找匹配的文本</span>\n    Matcher matcher=pattern.matcher(str);\n    <span class=\"hljs-comment\">// 循环遍历所有匹配结果</span>\n    <span class=\"hljs-keyword\">while</span> (matcher.find()) {\n        <span class=\"hljs-comment\">// 将匹配结果转换为整数类型</span>\n        <span class=\"hljs-keyword\">int</span> parseInt = Integer.parseInt(matcher.group());\n        <span class=\"hljs-comment\">// 将匹配结果累加到sum变量中</span>\n        sum+=parseInt;\n    }\n    <span class=\"hljs-comment\">// 返回统计结果</span>\n    <span class=\"hljs-keyword\">return</span> sum;\n}\n</code></div></pre>\n', 1730417766767050753);
INSERT INTO `ms_article_body` VALUES (1730417968332718084, '---\n66666666\n---\n\n# 二级必过\n\n## excel函数\n\n> 1. vlookup函数\n\n=vlookup(查询的对象($\\textcolor{red}{根据什么来查} $),查询的区域,结果所在列,精确匹配还是模糊匹配)\n\n例: vlookup(E3,表4[全部],2,False)\n\n$\\textcolor{blue}{解析: 在列E3中的数据与表4匹配,匹配的结果为第二列,模式为精确匹配}$\n\n> 2. sumifs多条件求和\n\n=sumifs(计算求和列,条件,条件)\n\n例:sumifs(费用报销管理!G2:G401,费用报销管理!A2:A401,\">=2013-4-1\")\n\n$\\textcolor{blue}{解析: 在列费用报销管理中的数据中,时间大于2013-4-1号的金额求和}$\n\n> 3. rank排名函数-------------->需要绝对引用（fn）+f4\n\n=rank(排名对象,排名数据区域)\n\n例：=RANK(M7,[总分])\n\n排名对象为你的总成绩,区域为全部成员总成绩\n\n> 4. lookup函数\n\n=lookup(所求数,转化前的值,与前面对应的转换后的值)\n\n例：=LOOKUP(MID([@学号],3,2),{\"01\",\"02\",\"03\",\"04\"},{\"法律一班\",\"法律二班\",\"法律三班\",\"法律四班\"})\n\n查找出学号的第三四位数,01替换为法律一班,以此类推\n\n> 5. datedif函数\n\n=datedif(起始日期,终止日期,日期单位)\n\n例:2009-2022年相距日期\n\n=datedif(2009,2022,\"y\")\n\n结果为:11\n\n> 6. month函数\n\n=month(日期)\n\n例：=month(2022年11月)\n\n结果为：11\n\n> 7. roundup函数\n\n=roundup(数值)\n\n例:=roundup(1/3)\n\n向上取整为:1\n\n> 8.数组计算-----------------------------------------------------------------------------------------------小黑课堂16excel\n\n例：=COUNT(IF(**(成绩单!A:A=按班级汇总!A2)****(成绩单!B:B=按班级汇总!B2)*,成绩单!D:D))\n\n键盘敲击ctr+shift+enter即可执行函数\n\n解释:$\\textcolor{red}{当成绩单!A:A=按班级汇总!A2和成绩单!B:B=按班级汇总!B2同时成立时,取出成绩单!D:D作为数组，前面的count进行数数}$\n\n> 9.按照排名返回相应数值large\n\n例:=LARGE(表1[一月份],3)\n\n表1数据的销量第三名\n\n> 10.通过身份证号判断男女(**ISODD()**用来判断是否是奇数)\n\n=IF(ISODD(MID([@身份证号],17,1)),\"男\",\"女\")\n\n解释:如果是true,则为男，反之为女\n\n> 11.通过身份证号获取出生日期后更改格式-------------------text函数和mid函数\n\n=TEXT(MID([@身份证号],7,8),\"0000年00月00日\")\n\n解释:截取身份证号从第七位开始的8个字符,并将格式改为“0000年00月00日”格式\n\n> 12.通过身份证号来求年龄--------------------------------yearfrac函数\n\n=INT(YEARFRAC([@出生日期],\"2015-9-30\",0))\n\n解释:出生日期的函数为起点，2015-9-30为结束日期，按照30/360计算并为结果取整\n\n> 13.通过find来查找代号\n\n![image-20220920202938040](C:\\Users\\33535\\AppData\\Roaming\\Typora\\typora-user-images\\image-20220920202938040.png)\n', '<hr />\n<h2><a id=\"66666666_1\"></a>66666666</h2>\n<h1><a id=\"_4\"></a>二级必过</h1>\n<h2><a id=\"excel_6\"></a>excel函数</h2>\n<blockquote>\n<ol>\n<li>vlookup函数</li>\n</ol>\n</blockquote>\n<p>=vlookup(查询的对象($\\textcolor{red}{根据什么来查} $),查询的区域,结果所在列,精确匹配还是模糊匹配)</p>\n<p>例: vlookup(E3,表4[全部],2,False)</p>\n<p>\\textcolor{blue}{解析: 在列E3中的数据与表4匹配,匹配的结果为第二列,模式为精确匹配}</p>\n<blockquote>\n<ol start=\"2\">\n<li>sumifs多条件求和</li>\n</ol>\n</blockquote>\n<p>=sumifs(计算求和列,条件,条件)</p>\n<p>例:sumifs(费用报销管理!G2:G401,费用报销管理!A2:A401,&quot;&gt;=2013-4-1&quot;)</p>\n<p>\\textcolor{blue}{解析: 在列费用报销管理中的数据中,时间大于2013-4-1号的金额求和}</p>\n<blockquote>\n<ol start=\"3\">\n<li>rank排名函数--------------&gt;需要绝对引用（fn）+f4</li>\n</ol>\n</blockquote>\n<p>=rank(排名对象,排名数据区域)</p>\n<p>例：=RANK(M7,[总分])</p>\n<p>排名对象为你的总成绩,区域为全部成员总成绩</p>\n<blockquote>\n<ol start=\"4\">\n<li>lookup函数</li>\n</ol>\n</blockquote>\n<p>=lookup(所求数,转化前的值,与前面对应的转换后的值)</p>\n<p>例：=LOOKUP(MID([@学号],3,2),{“01”,“02”,“03”,“04”},{“法律一班”,“法律二班”,“法律三班”,“法律四班”})</p>\n<p>查找出学号的第三四位数,01替换为法律一班,以此类推</p>\n<blockquote>\n<ol start=\"5\">\n<li>datedif函数</li>\n</ol>\n</blockquote>\n<p>=datedif(起始日期,终止日期,日期单位)</p>\n<p>例:2009-2022年相距日期</p>\n<p>=datedif(2009,2022,“y”)</p>\n<p>结果为:11</p>\n<blockquote>\n<ol start=\"6\">\n<li>month函数</li>\n</ol>\n</blockquote>\n<p>=month(日期)</p>\n<p>例：=month(2022年11月)</p>\n<p>结果为：11</p>\n<blockquote>\n<ol start=\"7\">\n<li>roundup函数</li>\n</ol>\n</blockquote>\n<p>=roundup(数值)</p>\n<p>例:=roundup(1/3)</p>\n<p>向上取整为:1</p>\n<blockquote>\n<p>8.数组计算-----------------------------------------------------------------------------------------------小黑课堂16excel</p>\n</blockquote>\n<p>例：=COUNT(IF(**(成绩单!A:A=按班级汇总!A2)***<em>(成绩单!B:B=按班级汇总!B2)</em>,成绩单!D:D))</p>\n<p>键盘敲击ctr+shift+enter即可执行函数</p>\n<p>解释:\\textcolor{red}{当成绩单!A:A=按班级汇总!A2和成绩单!B:B=按班级汇总!B2同时成立时,取出成绩单!D:D作为数组，前面的count进行数数}</p>\n<blockquote>\n<p>9.按照排名返回相应数值large</p>\n</blockquote>\n<p>例:=LARGE(表1[一月份],3)</p>\n<p>表1数据的销量第三名</p>\n<blockquote>\n<p>10.通过身份证号判断男女(**ISODD()**用来判断是否是奇数)</p>\n</blockquote>\n<p>=IF(ISODD(MID([@身份证号],17,1)),“男”,“女”)</p>\n<p>解释:如果是true,则为男，反之为女</p>\n<blockquote>\n<p>11.通过身份证号获取出生日期后更改格式-------------------text函数和mid函数</p>\n</blockquote>\n<p>=TEXT(MID([@身份证号],7,8),“0000年00月00日”)</p>\n<p>解释:截取身份证号从第七位开始的8个字符,并将格式改为“0000年00月00日”格式</p>\n<blockquote>\n<p>12.通过身份证号来求年龄--------------------------------yearfrac函数</p>\n</blockquote>\n<p>=INT(YEARFRAC([@出生日期],“2015-9-30”,0))</p>\n<p>解释:出生日期的函数为起点，2015-9-30为结束日期，按照30/360计算并为结果取整</p>\n<blockquote>\n<p>13.通过find来查找代号</p>\n</blockquote>\n<p><img src=\"C:%5CUsers%5C33535%5CAppData%5CRoaming%5CTypora%5Ctypora-user-images%5Cimage-20220920202938040.png\" alt=\"image-20220920202938040\" /></p>\n', 1730417968332718082);
INSERT INTO `ms_article_body` VALUES (1730418106799276036, '\n\n# 自动化测试\n\n## selenium使用\n\n### 元素定位\n\n| 类型              | 作用                 |\n| ----------------- | -------------------- |\n| id                | 根据元素id定位       |\n| name              | 根据元素name定义     |\n| class_name        | 根据元素类名定义     |\n| tag_name          | 根据元素标签名定义   |\n| link_text         | 定位超链接a标签      |\n| partial_link_text | 定位超链接a标签 模糊 |\n| xpath             | 基于元素路径         |\n| css               | 元素选择器           |\n\n### id,class_name,name定位\n\n```python\ndriver.find_element_by_id(id)\ndriver.find_element_by_name(name)\ndriver.find_element_by_class_name(classname)\n```\n\n实例：\n\n> 自动打开页面查找到id,自动输入值，3s后关闭\n\n```python\n#导包\nfrom selenium import webdriver\nfrom time import sleep\n#获取浏览器驱动对象\ndriver = webdriver.Chrome()\n#打开指定地址\nurl=r\"D:\\BaiduNetdiskDownload\\zdhtest\\auto_day_01\\02_其他资料\\注册A.html\"\ndriver.get(url)\n#查找id\nusername = driver.find_element_by_id(\"userA\")\npassword=driver.find_element_by_id(\"passwordA\")\n#输入值\nusername.send_keys(\"admin\")\npassword.send_keys(\"12345\")\n#睡眠3s\nsleep(3)\n#关闭\ndriver.quit()\n```\n\n### a链接定位\n\n> driver.find_element_by_link_text(值)只能精确匹配文字链接\n>\n> driver.find_element_by_partial_link_text(值)模糊匹配链接中的文字\n\n```python\n# find_element_by_link_text只能精确匹配文字链接\na = driver.find_element_by_link_text(\"访问 新浪 网站\")\n# 模糊匹配链接中的文字\n#a=driver.find_element_by_partial_link_text(\"新浪\")\n# 执行点击方法\na.click()\n```\n\n### Xpath使用\n\n>xml 是一种标记语言 作用：数据的存储与传递（配置文件）\n\n常用定位策略\n\n- 路径     \n  - 绝对路径：/html/body/form/div/fieldset/p[1]\n  - 相对路径：//input\n- 路径加属性：//input[@type=\"password\"]\n- 路径加逻辑（多个属性）：`//input[@type=\"textA\" and @name=\"userA\"]`\n- 路径加层级：//p[@id=\"login-T3\"]/input                             在edge控制台中用法 ==$x(\'//p[@id=\"login-T3\"]/input\')==\n\n```python\n#使用xpath绝对定位\ndriver.find_element_by_xpath(\"//*[@id=\'userA\']\").send_keys(\"admin\")\n#使用xpath相对定位\ndriver.find_element_by_xpath(\"//input[@id=\'passwordA\']\").send_keys(\"12345\")\n```\n\n扩展\n\n1. 包含相应文字                                               //*[text()=\"值\"]\n2. 属性中包含xx元素                                           //*[contains(@attribute,\'xxx\')]\n3. 属性以xx开头的元素                                         //*[starts-with(@attribute,\'xxx\')]\n\n### css定位\n\n> 获取文本内容.text\n\n```python\n#使用css id选择器选中用户名输入admin\ndriver.find_element_by_css_selector(\'#userA\').send_keys(\"admin\")\nsleep(2)\n#使用css 属性选择定位密码\ndriver.find_element_by_css_selector(\'fieldset p:nth-of-type(2) input\').send_keys(\'12345\')\nsleep(2)\n# 使用css class定位电话号码\ndriver.find_element_by_css_selector(\'.telA\').send_keys(\'18537683875\')\nsleep(2)\n#使用css 层级获取email\ndriver.find_element_by_css_selector(\'p>input[name=\"emailA\"]\').send_keys(\"123@qq.com\")\n#使用元素选择器定位位span --------------------获取文本值\ntext = driver.find_element_by_css_selector(\'span\').text\n```\n\n> driver.find_element()         查找元素底层逻辑\n\n```python\n#定位用户名\ndriver.find_element(By.ID,\"userA\").send_keys(\"12345\")\n#使用电话号码\ndriver.find_element(By.CLASS_NAME,\"telA\").send_keys(\"16666\")\ndriver.find_elements_by_name(\'fruit\')[0].click()\n```\n\n### 常用操作方法\n\n- send_keys() 写入内容\n- click() 点击\n- clear() 清空内容---->在写入内容之前需要操作\n- text  读取文本内容\n\n### 浏览器操作\n\n> 浏览器最大化-----------------------maximize_window()\n>\n> 设置固定大小-----------------------set_window_size(x,y)\n>\n> 移动浏览器窗口位置-------------------set_window_position(x,y) 左上角为0，0位置\n>\n> 前进---------------------------------forward()\n>\n> 后退----------------------------------back()\n\n```python\n#将浏览器最大化\ndriver.maximize_window()\n#设置固定大小 300，200\ndriver.set_window_size(300,200)\n#移动浏览器窗口位置 x:320,y:150\ndriver.set_window_position(200,150)\n#最大化\ndriver.maximize_window()\n#点击访问新浪网站 ----》为后退提供条件\ndriver.find_element_by_partial_link_text(\'访问\').click()\n#执行后退\ndriver.back()\n# 执行前进\ndriver.forward()\n```\n\n> refresh()-----刷新\n>\n> title--------获取标题\n>\n> current_url----获取当前url\n>\n> close()--------关闭主窗口(为当默认窗口)\n>\n> quit()---------为关闭浏览器驱动\n\n```python\n#在用户名输入值\ndriver.find_element_by_css_selector(\'#user\').send_keys(\'admin\')\n#刷新\ndriver.refresh()\n#获取当前title\ntitle = driver.title\n#获取当前url\ncurrent_url = driver.current_url\n#点击 注册A网页 打开新窗口\ndriver.find_element_by_partial_link_text(\'注册A网页\').click()\n#关闭主窗口(为当默认窗口)\ndriver.close()\n#关闭驱动\ndriver.quit()\n```\n\n> 用户框大小--------------------size\n>\n> 元素属性值--------------------get_attribute(\'属性名\')\n>\n> 元素是否可见-------------------is_displayed()\n>\n> 元素是否可用-------------------is_enabled()\n>\n> 元素是否被选中------------------is_selected()\n\n```python\n#用户框大小\nsize = driver.find_element_by_css_selector(\'#user\').size\nprint(size)\n#a标签属性\nhref = driver.find_element_by_css_selector(\'a\').get_attribute(\'href\')\nprint(href)\n#span标签是否可见\nspan = driver.find_element_by_css_selector(\'span\').is_displayed()\nprint(span)\n#取消按钮是否可用\ncancel = driver.find_element_by_css_selector(\'#cancel\').is_enabled()\nprint(cancel)\n#旅游是否被选中\nly = driver.find_element_by_css_selector(\'#ly\').is_selected()\n```\n\n### 鼠标键盘操作\n\n| 方法                 | 作用                                       |\n| -------------------- | ------------------------------------------ |\n| ActionChains(driver) | 实例化获取Actionchains类（鼠标事件必须）！ |\n| context_click()      | 模拟鼠标右键                               |\n| double_click()       | 模拟鼠标左键双击                           |\n| move_to_element()    | 鼠标悬停到指定元素上                       |\n| drag_and_drop        | 拖拽元素                                   |\n| perform()            | 必须执行整个方法才能实现鼠标事件           |\n\n```python\n#实例化获取Actionchains类\nchains = ActionChains(driver)\n#定位用户名 admin在用户名上右键-------》出现粘贴\nusername = driver.find_element_by_css_selector(\'#userA\')\nusername.send_keys(\'admin\')\nchains.context_click(username).perform()\nsleep(6)\n#定位密码框发送12345双击\npassword = driver.find_element_by_css_selector(\'#passwordA\')\npassword.send_keys(\'12345\')\nchains.double_click(password).perform()\nsleep(4)\n#鼠标移动到注册按钮\nchains.move_to_element(driver.find_element_by_css_selector(\'button\')).perform()\n```\n\n> 键盘事件：\n>\n> ​	send_keys(Keys.BACKSPACE)   		删除键\n>\n> ​	send_keys(Keys.CONTROL,\'a\')		 ctrl+a（复制）\n\n```python\n#删除1\nusername.send_keys(Keys.BACKSPACE)\nsleep(3)\n#全选用户名\nusername.send_keys(Keys.CONTROL,\'a\')\nsleep(3)\n#复制\nusername.send_keys(Keys.CONTROL,\'c\')\nsleep(3)\n#粘贴到密码框\npassword = driver.find_element_by_css_selector(\'#passwordA\')\npassword.send_keys(Keys.CONTROL,\'v\')\n```\n\n> 等待：自动化工具未找到该元素时,等待指定时间再去寻找,如果过了指定时间还找不到就抛出异常\n>\n> ​	隐式等待：\n>\n> ​		driver.implicitly_wait(30)       通常等待30s，全局 抛出的异常为（NoSuchElementException）\n>\n> ​	显示等待：\n>\n> ​		WebDriverWait(driver,timeout,poll_frequency)\n>\n> ​			timeout:超时时间      poll_frequency：访问频率\n>\n> 区别：隐式等待作用于全局，显示等待作用于单一元素\n\n```python\n#显示等待\nWebDriverWait(driver,timeout=10,poll_frequency=0.5).until(lambda x:x.find_element_by_css_selector(\'#password\')).send_keys(\'1234\')\n```\n\n### Select下拉框\n\n```python\n#---------------css通过value也可以选中下拉框----------------\n#导入Select包,获取元素对象\nsel = Select(driver.find_element_by_tag_name(\'select\'))\n#1.根据索引来选\nsel.select_by_index(1)\nsleep(3)\n#2.根据value值来选\nsel.select_by_value(\'gz\')\nsleep(3)\n#3.根据文本来选\nsel.select_by_visible_text(\"A重庆\")\nsleep(3)\n```\n\n### alert-confirm-prompt弹窗\n\n```python\nal = driver.switch_to.alert\n#获取弹窗结果\nprint(\'弹窗结果为：\',al.text)\n#取消\nal.dismiss()\n#确定\nal.accept()\n```\n\n#### 滚动条\n\n>js=\'window.scrollTo(0,10000)\'  #距离左边距,距离上边距\n>driver.execute_script(js)      #执行js代码\n\n### frame表单切换\n\n>driver.switch_to.frame(\'idframe1\')  #进入frame页面,传入的值可以为id，class名\n>\n>driver.switch_to.default_content()  #转到默认主页面\n\n```python\n#用户名\ndriver.find_element_by_css_selector(\'#user\').send_keys(\'admin\')\n#密码\ndriver.find_element_by_css_selector(\'#password\').send_keys(\'admin\')\n#----想要在frame网页中定位元素需要使用switch_to.frame()方法,值可以为id,class\ndriver.switch_to.frame(\'idframe1\')\n#定位元素输入值\ndriver.find_element_by_css_selector(\'#userA\').send_keys(\'admin\')\n#密码\ndriver.find_element_by_css_selector(\'#passwordA\').send_keys(\'admin\')\n#退出framea切换到主页面进入frameb\ndriver.switch_to.default_content()\n#进入frameb页面\ndriver.switch_to.frame(\'myframe2\')\n#定位元素输入值\ndriver.find_element_by_css_selector(\'#userB\').send_keys(\'admin\')\n```\n\n### 窗口切换\n\n> selenium默认获取到的是主窗口元素,如果点击跳转到其他窗口则无法操控元素,所以用到了窗口句柄的切换\n>\n> 1.获取到当前窗口句柄\n>\n> 2.点击a链接跳转到目的窗口\n>\n> 3.获取所有的窗口句柄\n>\n> 4.遍历所有的窗口句柄\n>\n>  4.1:如果当前窗口是目的窗口则执行代码\n\n```python\n#获取主窗口句柄\ncurrent_handle = driver.current_window_handle\n#点击a链接跳转到注册a页面\ndriver.find_element_by_partial_link_text(\'注册A\').click()\n#获取所有窗口句柄\nhandles = driver.window_handles\n#遍历所有的handles句柄判断是不是新打开的窗口\nfor handle in handles:\n    if handle!=current_handle:\n        #切换到目的窗口\n        driver.switch_to.window(handle)\n        driver.find_element_by_css_selector(\'#userA\').send_keys(\'admin\')\n        sleep(3)\n        # 密码\n        driver.find_element_by_css_selector(\'#passwordA\').send_keys(\'admin\')\n```\n\n#屏幕截图\n\n```python\ndriver.get_screenshot_as_file(f\'../image/{time.strftime(\"%Y_%m_%d %H_%M_%S\")}.png\')\n```\n### cookie的使用\n\n```python\nurl=\'http://www.baidu.com\'\ndriver.get(url)\n#设置cookie值\ndriver.add_cookie({\'name\':\'BDUSS\',\'value\':\'FZSc1l1fkc2SXNrSUNFVUpieEEzcGZ5ZzhIYjZLSXJMT3ZvNkZVMzNtSkhzTVpqRVFBQUFBJCQAAAAAAAAAAAEAAABbQFXPv6iyvLK8tqG1xLnKysIAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAEcjn2NHI59jR\'})\n#设置cookie后必须刷新才能生效\ndriver.refresh()\n#获取所有cookie值\ncookies = driver.get_cookies()\n#根据cookie的name获取值\ncookie = driver.get_cookie(\'BDUSS\')\n```\n\n> 注：设置cookie后必须刷新才能生效！！！！！\n\n## UnitTest测试框架\n\n> TestCase(测试用例)\n>\n> 注：定义的测试函数前必须有test字符串才能被找到！！！！\n\n```python\n#导包\nimport unittest\n\n#先定义一个函数\ndef sum(x,y):\n    return x+y\n\n#定义一个测试类,继承unitTest\nclass testDemo(unittest.TestCase):\n    #定义一个测试方法,实现测试功能,定义的测试函数前必须有test字符串才能被找到\n    def test_sum1(self):\n        result=sum(2,3)\n        print(\"结果是：\",result)\n```\n\n> TestSuite(测试套件)：多个测试用例的集合,可以测试单个用例\n>\n> TextTestRunner（执行测试套件）\n\n```python\n#导包\nimport unittest\n#导入需要被测试的类\nfrom test01 import testDemo\n#实例化testsuite\nsuite = unittest.TestSuite()\n#添加测试用例到套件里面\n#1.类名(函数名),指定类中的指定测试方法\nsuite.addTest(testDemo(\'test_sum1\'))\n#2.添加扩展,搜索testDemo类中test开头的全部测试类\nsuite.addTest(unittest.makeSuite(testDemo))\n#将套件添加到TextTestRunner里面执行\nrunner = unittest.TextTestRunner()\nrunner.run(suite)\n```\n\n> ==TestLoader==\n>\n> 该类下的driver()可以自动搜索指定目录下的指定开头的py文件,执行效率高，返回为套件\n\n```python\n#导包\nimport unittest\n#调用TestLoader方法，返回套件\nsuite = unittest.defaultTestLoader.discover(\'../cases\', pattern=\'test0*.py\')\n#执行套件方法TextTestRunner\nunittest.TextTestRunner().run(suite)\n```\n\n#### fixture（装置函数）\n\n> 级别：\n>\n> ​	1.函数级别：setUp，tearDown\n>\n> ​		注：在每次执行测试用例时都会被执行一次\n>\n> ​	2.类级别setUpClass。tearDownClass\n>\n> ​		注：在调用该类会被执行一次开始，一次结束，只能执行一遍，且必须要用@classmethod声明\n\n```python\nimport unittest\n\nb=1\nclass Test01(unittest.TestCase):\n    #函数级别setUp，tearDown\n    def setUp(self):\n        print(\'每个函数执行前都会被执行一次\')\n    def tearDown(self):\n        print(\'每个函数执行结束都会被执行一次\')\n\n    #类级别setUpClass。tearDownClass\n    @classmethod\n    def setUpClass(cls):\n        print(\'Test01类被加载之前执行\')\n    @classmethod\n    def tearDownClass(cls):\n        global b\n        b+=4\n        print(\'Test01类被加载结束执行\',b)\n\n    def test_p01(self):\n        global b\n        b+=1\n        print(\'01被执行\',b)\n\n    def test_p02(self):\n        global b\n        b+=1\n        print(\'02被执行\',b)\n```\n\n### 常用断言方法\n\n> 1.self.assertEqual(s1,s2)  #断言s1是否等于s2\n>\n> 2.self.assertIn(s1,s2)     #断言s1是否包含在s2中\n>\n> 3.self.assertTrue(flag)    #断言flag是否为true\n\n```python\n#常用断言\nimport unittest\n\n\nclass Test01(unittest.TestCase):\n    #开启类加载\n    @classmethod\n    def setUpClass(cls):\n        print(\'开始加载类\')\n    def test_01(self):\n        self.assertEqual(\'123\',\'123\')\n    def test_02(self):\n        self.assertIn(\'abcde\',\'abcdefg\')\n    def test_03(self):\n        flag=1\n        self.assertTrue(flag)\n```\n\n### 生成html测试报告\n\n> 需要提前导包才能使用HTMLTestRunner\n>\n> ==HTMLTestRunner(stream=f,title=\'Html测试报告\',verbosity=2,description=\'测试用例执行\',).run(suite)==\n>\n> 在f文件中写入文件流,html标题为...,verbosity为测试结果的信息复杂度（2为详细模式），desciption为测试描述\n\n```python\n#导入HTMLTestRunner模块用于生成测试报告\nimport time\n\nimport unittest\n\nfrom HTMLTestRunner.HTMLTestRunner import HTMLTestRunner\n\n#通过defaulttestloader下的driver方法找到相应的测试py文件生成套件\nsuite = unittest.defaultTestLoader.discover(\'../cases\', pattern=\'test*.py\')\n#将测试套件执行的结果写入html测试报告中\ntest_dir=(f\'../files/{time.strftime(\"%Y_%m_%d %H_%M_%S\")}.html\')\nwith open(test_dir,\'w\',encoding=\'utf-8\') as f:\n    HTMLTestRunner(stream=f,title=\'Html测试报告\',verbosity=2,description=\'测试用例执行\',).run(suite)\n```\n\n\n\n### 参数化应用\n\n> 1.需要引入parameterized插件\n>\n> ​	1）命令行安装  pip install parameterized\n>\n> ​	2）pycharm安装--》设置--》project\n\n```python\n#需要导入paramated插件\nfrom parameterized import parameterized\nimport unittest\n\n#定义测试方法\ndef add(a,b):\n    return a+b\n\n#获取测试数据\ndef data_now():\n    return [(1,2,3),(2,1,3),(0,3,3)]\n\nclass Test_01(unittest.TestCase):\n    #使用parameterized插件参数化,用于测试步骤相同且数据较多时\n    @parameterized.expand(data_now())\n    def test_add(self,a,b,expect):\n        result = add(a, b)\n        self.assertEqual(result,expect)\n```\n\n## 案例\n\n![image-20221220160220486](C:\\Users\\33535\\AppData\\Roaming\\Typora\\typora-user-images\\image-20221220160220486.png)\n\n```python\n#先导包\nimport time\n\nfrom selenium import webdriver\nimport unittest\nfrom time import sleep\n#定义测试类\nclass Login_test(unittest.TestCase):\n    #测试函数执行前\n    def setUp(self):\n        #获取驱动\n        self.drive = webdriver.Chrome()\n        #跳转到网站\n        self.drive.get(\'https://demo6.tp-shop.cn/\')\n        #全屏，隐式等待\n        self.drive.maximize_window()\n        self.drive.implicitly_wait(20)\n    #定义测试函数\n    def test_login(self):\n        driver = self.drive\n        #点击登录按钮\n        driver.find_element_by_partial_link_text(\'登录\').click()\n        #输入账号密码，验证码为空\n        driver.find_element_by_css_selector(\'#username\').send_keys(\'18537683875\')\n        driver.find_element_by_css_selector(\'#password\').send_keys(\'12345\')\n        #点击登录获取弹出框的值\n        driver.find_element_by_css_selector(\'.J-login-submit\').click()\n        result = driver.find_element_by_css_selector(\'.layui-layer-content\').text\n        sleep(3)\n        #预期值与实际值进行对比（try-except）\n        try:\n            self.assertEqual(\'验证码不能为空!\',result)\n        except AssertionError:\n            driver.get_screenshot_as_file(f\'../{time.strftime(\"%Y_%m_%d %H_%M_%S\")}.png\')\n            print(\'弹出的结果为：\',result)\n            #将异常再次抛出\n            raise\n\n    #定义结束\n    def tearDown(self):\n        self.drive.quit()\n```\n### 使用po模式\n\n> 批量添加导航栏\n\nBasePage\n\n```python\nfrom selenium import webdriver\nfrom selenium.webdriver.support.wait import WebDriverWait\n\n\nclass Base():\n    def __init__(self,driver=None):\n        if driver!=None:\n            self.driver = driver\n        else:\n            self.driver = webdriver.Chrome()\n            self.driver.implicitly_wait(30)\n            self.driver.maximize_window()\n            self.driver.get(\"http://localhost:81/index.php/Admin/Admin/login\")\n\n    def base_element(self,loc):\n        return WebDriverWait(self.driver,timeout=30,poll_frequency=5).until(lambda x:x.find_element(*loc))\n\n    #输入\n    def base_input(self,loc,value):\n        ipt = self.base_element(loc)\n        ipt.clear()\n        ipt.send_keys(value)\n    #点击\n    def base_click(self,loc):\n        self.base_element(loc).click()\n    #获取文本值\n    def base_text(self,loc):\n        text = self.base_element(loc).text\n        return text\n    #截图\n    def base_img(self,pathfile):\n        self.driver.get_screenshot_as_file(pathfile)\n```\n\nLoginPage\n\n```python\nimport time\n\nfrom selenium.webdriver.common.by import By\n\nfrom com.PoTest.Page.BasePage import Base\nLogin_username=By.NAME,\"username\"\nLogin_password=By.NAME,\"password\"\nLogin_vertify=By.NAME,\"vertify\"\nLogin_btn=By.CLASS_NAME,\"sub\"\nclass Login(Base):\n    #输入用户名\n    def login_username(self,username):\n        self.base_input(Login_username,username)\n    #输入密码\n    def login_password(self,password):\n        self.base_input(Login_password,password)\n    #输入验证码\n    def login_vertify(self,vertify):\n        self.base_input(Login_vertify,vertify)\n    #点击登录\n    def login_btn(self):\n        self.base_click(Login_btn)\n    #总和\n    def login_all(self,username,password,vertify):\n        self.login_username(username)\n        self.login_password(password)\n        self.login_vertify(vertify)\n        time.sleep(3)\n        self.login_btn()\n\n# if __name__==\"__main__\":\n#     login = Login()\n#     login.login_all(\"admin\",\"123456\",\"8888\")\n```\n\nAddPage\n\n```python\nimport time\n\nfrom selenium.webdriver.common.by import By\nfrom selenium.webdriver.support.select import Select\n\nfrom com.PoTest.Page.LoginPage import Login\nAdd_banner=By.XPATH,\"/html/body/div[1]/div[4]/ul/li[1]/a\"\nAdd_list=By.LINK_TEXT,\"自定义导航栏\"\nAdd_btn=By.CSS_SELECTOR,\"[href=\'/index.php/Admin/System/addEditNav\']\"  #frame id=workspace\nAdd_order=By.ID,\"sort\"\nAdd_submit=By.ID,\"submitBtn\"\nclass Add(Login):\n    #点击系统\n    def add_banner(self):\n        self.base_click(Add_banner)\n    #点击自定义导航栏\n    def add_list(self):\n        self.base_click(Add_list)\n    #点击新增导航\n    def add_btn(self):\n        #由于是frame框架\n        time.sleep(3)\n        frame1 = self.driver.find_element_by_id(\"workspace\")\n        self.driver.switch_to.frame(frame1)\n        self.base_click(Add_btn)\n    #选择下拉框\n    def add_sel(self,index):\n        sel = self.driver.find_element_by_id(\"system_nav\")\n        select = Select(sel)\n        select.select_by_index(index)\n    #输入值\n    def add_sort(self,sort):\n        self.base_input(Add_order,sort)\n    #确认\n    def add_submit(self):\n        self.base_click(Add_submit)\n\n    #集合\n    def add_all(self,index,sort):\n        Login.login_all(self,\"admin\",\"123456\",\"8888\")\n        self.add_banner()\n        self.add_list()\n        self.add_btn()\n        self.add_sel(index)\n        self.add_sort(sort)\n        time.sleep(3)\n        self.add_submit()\n\n# if __name__==\"__main__\":\n#     add = Add()\n#     add.add_all(1,\"2\")\n```\n\ntest里面的csv读取\n\ncsvv\n\n```python\nimport csv\n\n\ndef csvv(filepath):\n    with open(filepath,\"r\",encoding=\"utf-8\") as f:\n        reader = csv.reader(f)\n        list01=[]\n        j=0\n        for i in reader:\n            if j!=0:\n                list01.append(tuple(i))\n            else:\n                pass\n            j+=1\n        return list01\n\n\n# l = csvv(\"datacsv01.csv\")\n# print(l)\n```\n\ntest_Add\n\n```python\nimport unittest\n\nfrom com.PoTest.Page.AddPage import Add\nfrom ddt import ddt,unpack,data\nfrom csvv import csvv\n@ddt\nclass test(unittest.TestCase):\n    def setUp(self):\n        self.add = Add()\n    def tearDown(self):\n        self.add.driver.quit()\n\n    @data(*csvv(\"datacsv01.csv\"))\n    @unpack\n    def test01(self,index,order):\n        self.add.add_all(index,order)\n\nif __name__==\"__main__\":\n    unittest.main()\n\n```\n\n数据\n\n![image-20230421160627597](C:\\Users\\33535\\AppData\\Roaming\\Typora\\typora-user-images\\image-20230421160627597.png)\n\n## 数据驱动\n\n### json使用\n\n> 将json字符串转换为字典\n>\n>  1).json.dumps()\n>\n> 将字典转换为json字符串\n>\n>  2).json.loads()\n\n```python\n#将json字符串转换为字典\njdata2=\'{\"name\":\"zy\",\"age\":18}\'\ndata_dict2 = json.loads(jdata2)\n#将字典转换为json字符串\ndata_dict={\'name\':\'zy\',\'age\':18}\njdata = json.dumps(data_dict)\n```\n\n> 写入json文件\n\n```python\ndata_dict={\'name\':\'zy\',\'age\':18}\nwith open(\'./jsonfile/file01.json\',\'w\',encoding=\'utf-8\') as f:\n    json.dump(data_dict,f)\n    \n#读取json文件使用load结果为字典\n```\n\n## 读取csv文件\n\n```python\ndef csvopenfile(filename):\n    filepath=\"../../../files/\"+filename\n    arr=[]\n    with open(filepath,\'r\',encoding=\'utf-8\') as f:\n        f_csv = csv.reader(f)\n        for r in f_csv:\n            arr.append(tuple(r))\n        print(arr)\ncsvopenfile(\"ces.csv\")\n#[(1, 2, \'3\'), (168, 170, \'338\')]\n```\n\n### 小tips\n\n> 日期控件显示readonly该怎么办?\n>\n> 解决方法:使用js删除只读属性\n\n```js\ndocument.getElementById(\"date\").removeAttribute(\"readonly\")\n```\n\n> 把滚动条拉到最底部该怎么做?\n\n```python\nfrom selenium import webdriver\n\nbrowser = webdriver.Chrome() # 创建浏览器对象\nbrowser.execute_script(\n    \'window.scrollTo(0,document.body.scrollHeight)\'\n) # 把滚动条拉到最底部\n```\n\n### ddt\n\n> 使用ddt将读取到的csv数据参数化\n\n`读取csv文件函数`\n\n```python\nimport csv\n\ndef csvv(filepath):\n    with open(filepath,\"r\",encoding=\"utf-8\") as f:\n        reader = csv.reader(f)\n        list01=[]\n        j=0\n        for i in reader:\n            if j!=0:\n                list01.append(tuple(i))\n            else:\n                pass\n            j+=1\n        return list01\n\n#返回的数据如下\n[(\'niu\', \'123\', \'123\', \'success！\'), (\'niu\', \'123\', \'\', \'success！\'), (\'\', \'123\', \'123\', \'用户名不能为空！\'), (\'niu\', \'\', \'123\', \'密码不能为空！\'), (\'\', \'\', \'123\', \'用户名和密码错误！\'), (\'\', \'\', \'\', \'用户名和密码错误！\')]\n```\n\n> 测试类\n\n```python\nimport unittest\n\nfrom ddt import ddt, data,unpack\nfrom selenium import webdriver\nimport time\nfrom com.kabu.test.test03.csvv import csvv\n\n@ddt												#在一个测试类上使用@ddt装饰器时，ddt库会自动为该测试类生成多个测试函数\nclass test01_01(unittest.TestCase):\n    def setUp(self):\n        self.driver = webdriver.Chrome()\n        self.driver.implicitly_wait(3)\n        self.driver.maximize_window()\n        url=\"http://127.0.0.1:8020/selenium%E7%BB%83%E4%B9%A0/test02.html?__hbt=1681031952063\"\n        self.driver.get(url)\n    def tearDown(self):\n        self.driver.quit()\n\n    @data(*csvv(\"testdata01.csv\"))								#读取全部数据\n    @unpack														#解包,将每个元组当成一条数据\n    def testuser(self,username,psd,zhu,expect):					#将每个元组的四个字段分别赋值\n        driver=self.driver\n        driver.find_element_by_id(\"username\").send_keys(username)\n        driver.find_element_by_id(\"psd\").send_keys(psd)\n        driver.find_element_by_id(\"beizhu\").send_keys(zhu)\n        driver.find_element_by_id(\"sub\").click()\n        time.sleep(3)\n        result = driver.find_element_by_xpath(\"//*[@id=\'content\']/p\").text\n        try:\n            self.assertEqual(expect,result)\n        except AssertionError:\n            driver.get_screenshot_as_file(\"../img/error.png\")\n            raise\n\nif __name__==\"__main__\":\n    unittest.main()\n```\n\n> 注意弹窗中的换行符\n\n```python\nresult = alert.text.replace(\"\\n\",\"\")\n```\n\n', '<h1><a id=\"_2\"></a>自动化测试</h1>\n<h2><a id=\"selenium_4\"></a>selenium使用</h2>\n<h3><a id=\"_6\"></a>元素定位</h3>\n<table>\n<thead>\n<tr>\n<th>类型</th>\n<th>作用</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>id</td>\n<td>根据元素id定位</td>\n</tr>\n<tr>\n<td>name</td>\n<td>根据元素name定义</td>\n</tr>\n<tr>\n<td>class_name</td>\n<td>根据元素类名定义</td>\n</tr>\n<tr>\n<td>tag_name</td>\n<td>根据元素标签名定义</td>\n</tr>\n<tr>\n<td>link_text</td>\n<td>定位超链接a标签</td>\n</tr>\n<tr>\n<td>partial_link_text</td>\n<td>定位超链接a标签 模糊</td>\n</tr>\n<tr>\n<td>xpath</td>\n<td>基于元素路径</td>\n</tr>\n<tr>\n<td>css</td>\n<td>元素选择器</td>\n</tr>\n</tbody>\n</table>\n<h3><a id=\"idclass_namename_19\"></a>id,class_name,name定位</h3>\n<pre><div class=\"hljs\"><code class=\"lang-python\">driver.find_element_by_id(id)\ndriver.find_element_by_name(name)\ndriver.find_element_by_class_name(classname)\n</code></div></pre>\n<p>实例：</p>\n<blockquote>\n<p>自动打开页面查找到id,自动输入值，3s后关闭</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#导包</span>\n<span class=\"hljs-keyword\">from</span> selenium <span class=\"hljs-keyword\">import</span> webdriver\n<span class=\"hljs-keyword\">from</span> time <span class=\"hljs-keyword\">import</span> sleep\n<span class=\"hljs-comment\">#获取浏览器驱动对象</span>\ndriver = webdriver.Chrome()\n<span class=\"hljs-comment\">#打开指定地址</span>\nurl=<span class=\"hljs-string\">r\"D:\\BaiduNetdiskDownload\\zdhtest\\auto_day_01\\02_其他资料\\注册A.html\"</span>\ndriver.get(url)\n<span class=\"hljs-comment\">#查找id</span>\nusername = driver.find_element_by_id(<span class=\"hljs-string\">\"userA\"</span>)\npassword=driver.find_element_by_id(<span class=\"hljs-string\">\"passwordA\"</span>)\n<span class=\"hljs-comment\">#输入值</span>\nusername.send_keys(<span class=\"hljs-string\">\"admin\"</span>)\npassword.send_keys(<span class=\"hljs-string\">\"12345\"</span>)\n<span class=\"hljs-comment\">#睡眠3s</span>\nsleep(<span class=\"hljs-number\">3</span>)\n<span class=\"hljs-comment\">#关闭</span>\ndriver.quit()\n</code></div></pre>\n<h3><a id=\"a_52\"></a>a链接定位</h3>\n<blockquote>\n<p>driver.find_element_by_link_text(值)只能精确匹配文字链接</p>\n<p>driver.find_element_by_partial_link_text(值)模糊匹配链接中的文字</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\"># find_element_by_link_text只能精确匹配文字链接</span>\na = driver.find_element_by_link_text(<span class=\"hljs-string\">\"访问 新浪 网站\"</span>)\n<span class=\"hljs-comment\"># 模糊匹配链接中的文字</span>\n<span class=\"hljs-comment\">#a=driver.find_element_by_partial_link_text(\"新浪\")</span>\n<span class=\"hljs-comment\"># 执行点击方法</span>\na.click()\n</code></div></pre>\n<h3><a id=\"Xpath_67\"></a>Xpath使用</h3>\n<blockquote>\n<p>xml 是一种标记语言 作用：数据的存储与传递（配置文件）</p>\n</blockquote>\n<p>常用定位策略</p>\n<ul>\n<li>路径\n<ul>\n<li>绝对路径：/html/body/form/div/fieldset/p[1]</li>\n<li>相对路径：//input</li>\n</ul>\n</li>\n<li>路径加属性：//input[@type=“password”]</li>\n<li>路径加逻辑（多个属性）：<code>//input[@type=&quot;textA&quot; and @name=&quot;userA&quot;]</code></li>\n<li>路径加层级：//p[@id=“login-T3”]/input                             在edge控制台中用法 <mark>$x(’//p[@id=“login-T3”]/input’)</mark></li>\n</ul>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#使用xpath绝对定位</span>\ndriver.find_element_by_xpath(<span class=\"hljs-string\">\"//*[@id=\'userA\']\"</span>).send_keys(<span class=\"hljs-string\">\"admin\"</span>)\n<span class=\"hljs-comment\">#使用xpath相对定位</span>\ndriver.find_element_by_xpath(<span class=\"hljs-string\">\"//input[@id=\'passwordA\']\"</span>).send_keys(<span class=\"hljs-string\">\"12345\"</span>)\n</code></div></pre>\n<p>扩展</p>\n<ol>\n<li>包含相应文字                                               //*[text()=“值”]</li>\n<li>属性中包含xx元素                                           //*[contains(@attribute,‘xxx’)]</li>\n<li>属性以xx开头的元素                                         //*[starts-with(@attribute,‘xxx’)]</li>\n</ol>\n<h3><a id=\"css_93\"></a>css定位</h3>\n<blockquote>\n<p>获取文本内容.text</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#使用css id选择器选中用户名输入admin</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'#userA\'</span>).send_keys(<span class=\"hljs-string\">\"admin\"</span>)\nsleep(<span class=\"hljs-number\">2</span>)\n<span class=\"hljs-comment\">#使用css 属性选择定位密码</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'fieldset p:nth-of-type(2) input\'</span>).send_keys(<span class=\"hljs-string\">\'12345\'</span>)\nsleep(<span class=\"hljs-number\">2</span>)\n<span class=\"hljs-comment\"># 使用css class定位电话号码</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'.telA\'</span>).send_keys(<span class=\"hljs-string\">\'18537683875\'</span>)\nsleep(<span class=\"hljs-number\">2</span>)\n<span class=\"hljs-comment\">#使用css 层级获取email</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'p&gt;input[name=\"emailA\"]\'</span>).send_keys(<span class=\"hljs-string\">\"123@qq.com\"</span>)\n<span class=\"hljs-comment\">#使用元素选择器定位位span --------------------获取文本值</span>\ntext = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'span\'</span>).text\n</code></div></pre>\n<blockquote>\n<p>driver.find_element()         查找元素底层逻辑</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#定位用户名</span>\ndriver.find_element(By.ID,<span class=\"hljs-string\">\"userA\"</span>).send_keys(<span class=\"hljs-string\">\"12345\"</span>)\n<span class=\"hljs-comment\">#使用电话号码</span>\ndriver.find_element(By.CLASS_NAME,<span class=\"hljs-string\">\"telA\"</span>).send_keys(<span class=\"hljs-string\">\"16666\"</span>)\ndriver.find_elements_by_name(<span class=\"hljs-string\">\'fruit\'</span>)[<span class=\"hljs-number\">0</span>].click()\n</code></div></pre>\n<h3><a id=\"_123\"></a>常用操作方法</h3>\n<ul>\n<li>send_keys() 写入内容</li>\n<li>click() 点击</li>\n<li>clear() 清空内容----&gt;在写入内容之前需要操作</li>\n<li>text  读取文本内容</li>\n</ul>\n<h3><a id=\"_130\"></a>浏览器操作</h3>\n<blockquote>\n<p>浏览器最大化-----------------------maximize_window()</p>\n<p>设置固定大小-----------------------set_window_size(x,y)</p>\n<p>移动浏览器窗口位置-------------------set_window_position(x,y) 左上角为0，0位置</p>\n<p>前进---------------------------------forward()</p>\n<p>后退----------------------------------back()</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#将浏览器最大化</span>\ndriver.maximize_window()\n<span class=\"hljs-comment\">#设置固定大小 300，200</span>\ndriver.set_window_size(<span class=\"hljs-number\">300</span>,<span class=\"hljs-number\">200</span>)\n<span class=\"hljs-comment\">#移动浏览器窗口位置 x:320,y:150</span>\ndriver.set_window_position(<span class=\"hljs-number\">200</span>,<span class=\"hljs-number\">150</span>)\n<span class=\"hljs-comment\">#最大化</span>\ndriver.maximize_window()\n<span class=\"hljs-comment\">#点击访问新浪网站 ----》为后退提供条件</span>\ndriver.find_element_by_partial_link_text(<span class=\"hljs-string\">\'访问\'</span>).click()\n<span class=\"hljs-comment\">#执行后退</span>\ndriver.back()\n<span class=\"hljs-comment\"># 执行前进</span>\ndriver.forward()\n</code></div></pre>\n<blockquote>\n<p>refresh()-----刷新</p>\n<p>title--------获取标题</p>\n<p>current_url----获取当前url</p>\n<p>close()--------关闭主窗口(为当默认窗口)</p>\n<p>quit()---------为关闭浏览器驱动</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#在用户名输入值</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'#user\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n<span class=\"hljs-comment\">#刷新</span>\ndriver.refresh()\n<span class=\"hljs-comment\">#获取当前title</span>\ntitle = driver.title\n<span class=\"hljs-comment\">#获取当前url</span>\ncurrent_url = driver.current_url\n<span class=\"hljs-comment\">#点击 注册A网页 打开新窗口</span>\ndriver.find_element_by_partial_link_text(<span class=\"hljs-string\">\'注册A网页\'</span>).click()\n<span class=\"hljs-comment\">#关闭主窗口(为当默认窗口)</span>\ndriver.close()\n<span class=\"hljs-comment\">#关闭驱动</span>\ndriver.quit()\n</code></div></pre>\n<blockquote>\n<p>用户框大小--------------------size</p>\n<p>元素属性值--------------------get_attribute(‘属性名’)</p>\n<p>元素是否可见-------------------is_displayed()</p>\n<p>元素是否可用-------------------is_enabled()</p>\n<p>元素是否被选中------------------is_selected()</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#用户框大小</span>\nsize = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#user\'</span>).size\nprint(size)\n<span class=\"hljs-comment\">#a标签属性</span>\nhref = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'a\'</span>).get_attribute(<span class=\"hljs-string\">\'href\'</span>)\nprint(href)\n<span class=\"hljs-comment\">#span标签是否可见</span>\nspan = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'span\'</span>).is_displayed()\nprint(span)\n<span class=\"hljs-comment\">#取消按钮是否可用</span>\ncancel = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#cancel\'</span>).is_enabled()\nprint(cancel)\n<span class=\"hljs-comment\">#旅游是否被选中</span>\nly = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#ly\'</span>).is_selected()\n</code></div></pre>\n<h3><a id=\"_213\"></a>鼠标键盘操作</h3>\n<table>\n<thead>\n<tr>\n<th>方法</th>\n<th>作用</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>ActionChains(driver)</td>\n<td>实例化获取Actionchains类（鼠标事件必须）！</td>\n</tr>\n<tr>\n<td>context_click()</td>\n<td>模拟鼠标右键</td>\n</tr>\n<tr>\n<td>double_click()</td>\n<td>模拟鼠标左键双击</td>\n</tr>\n<tr>\n<td>move_to_element()</td>\n<td>鼠标悬停到指定元素上</td>\n</tr>\n<tr>\n<td>drag_and_drop</td>\n<td>拖拽元素</td>\n</tr>\n<tr>\n<td>perform()</td>\n<td>必须执行整个方法才能实现鼠标事件</td>\n</tr>\n</tbody>\n</table>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#实例化获取Actionchains类</span>\nchains = ActionChains(driver)\n<span class=\"hljs-comment\">#定位用户名 admin在用户名上右键-------》出现粘贴</span>\nusername = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#userA\'</span>)\nusername.send_keys(<span class=\"hljs-string\">\'admin\'</span>)\nchains.context_click(username).perform()\nsleep(<span class=\"hljs-number\">6</span>)\n<span class=\"hljs-comment\">#定位密码框发送12345双击</span>\npassword = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#passwordA\'</span>)\npassword.send_keys(<span class=\"hljs-string\">\'12345\'</span>)\nchains.double_click(password).perform()\nsleep(<span class=\"hljs-number\">4</span>)\n<span class=\"hljs-comment\">#鼠标移动到注册按钮</span>\nchains.move_to_element(driver.find_element_by_css_selector(<span class=\"hljs-string\">\'button\'</span>)).perform()\n</code></div></pre>\n<blockquote>\n<p>键盘事件：</p>\n<p>​	send_keys(Keys.BACKSPACE)   		删除键</p>\n<p>​	send_keys(Keys.CONTROL,‘a’)		 ctrl+a（复制）</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#删除1</span>\nusername.send_keys(Keys.BACKSPACE)\nsleep(<span class=\"hljs-number\">3</span>)\n<span class=\"hljs-comment\">#全选用户名</span>\nusername.send_keys(Keys.CONTROL,<span class=\"hljs-string\">\'a\'</span>)\nsleep(<span class=\"hljs-number\">3</span>)\n<span class=\"hljs-comment\">#复制</span>\nusername.send_keys(Keys.CONTROL,<span class=\"hljs-string\">\'c\'</span>)\nsleep(<span class=\"hljs-number\">3</span>)\n<span class=\"hljs-comment\">#粘贴到密码框</span>\npassword = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#passwordA\'</span>)\npassword.send_keys(Keys.CONTROL,<span class=\"hljs-string\">\'v\'</span>)\n</code></div></pre>\n<blockquote>\n<p>等待：自动化工具未找到该元素时,等待指定时间再去寻找,如果过了指定时间还找不到就抛出异常</p>\n<p>​	隐式等待：</p>\n<p>​		driver.implicitly_wait(30)       通常等待30s，全局 抛出的异常为（NoSuchElementException）</p>\n<p>​	显示等待：</p>\n<p>​		WebDriverWait(driver,timeout,poll_frequency)</p>\n<p>​			timeout:超时时间      poll_frequency：访问频率</p>\n<p>区别：隐式等待作用于全局，显示等待作用于单一元素</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#显示等待</span>\nWebDriverWait(driver,timeout=<span class=\"hljs-number\">10</span>,poll_frequency=<span class=\"hljs-number\">0.5</span>).until(<span class=\"hljs-keyword\">lambda</span> x:x.find_element_by_css_selector(<span class=\"hljs-string\">\'#password\'</span>)).send_keys(<span class=\"hljs-string\">\'1234\'</span>)\n</code></div></pre>\n<h3><a id=\"Select_281\"></a>Select下拉框</h3>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#---------------css通过value也可以选中下拉框----------------</span>\n<span class=\"hljs-comment\">#导入Select包,获取元素对象</span>\nsel = Select(driver.find_element_by_tag_name(<span class=\"hljs-string\">\'select\'</span>))\n<span class=\"hljs-comment\">#1.根据索引来选</span>\nsel.select_by_index(<span class=\"hljs-number\">1</span>)\nsleep(<span class=\"hljs-number\">3</span>)\n<span class=\"hljs-comment\">#2.根据value值来选</span>\nsel.select_by_value(<span class=\"hljs-string\">\'gz\'</span>)\nsleep(<span class=\"hljs-number\">3</span>)\n<span class=\"hljs-comment\">#3.根据文本来选</span>\nsel.select_by_visible_text(<span class=\"hljs-string\">\"A重庆\"</span>)\nsleep(<span class=\"hljs-number\">3</span>)\n</code></div></pre>\n<h3><a id=\"alertconfirmprompt_298\"></a>alert-confirm-prompt弹窗</h3>\n<pre><div class=\"hljs\"><code class=\"lang-python\">al = driver.switch_to.alert\n<span class=\"hljs-comment\">#获取弹窗结果</span>\nprint(<span class=\"hljs-string\">\'弹窗结果为：\'</span>,al.text)\n<span class=\"hljs-comment\">#取消</span>\nal.dismiss()\n<span class=\"hljs-comment\">#确定</span>\nal.accept()\n</code></div></pre>\n<h4><a id=\"_310\"></a>滚动条</h4>\n<blockquote>\n<p>js=‘window.scrollTo(0,10000)’  #距离左边距,距离上边距<br />\ndriver.execute_script(js)      #执行js代码</p>\n</blockquote>\n<h3><a id=\"frame_315\"></a>frame表单切换</h3>\n<blockquote>\n<p>driver.switch_to.frame(‘idframe1’)  #进入frame页面,传入的值可以为id，class名</p>\n<p>driver.switch_to.default_content()  #转到默认主页面</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#用户名</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'#user\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n<span class=\"hljs-comment\">#密码</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'#password\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n<span class=\"hljs-comment\">#----想要在frame网页中定位元素需要使用switch_to.frame()方法,值可以为id,class</span>\ndriver.switch_to.frame(<span class=\"hljs-string\">\'idframe1\'</span>)\n<span class=\"hljs-comment\">#定位元素输入值</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'#userA\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n<span class=\"hljs-comment\">#密码</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'#passwordA\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n<span class=\"hljs-comment\">#退出framea切换到主页面进入frameb</span>\ndriver.switch_to.default_content()\n<span class=\"hljs-comment\">#进入frameb页面</span>\ndriver.switch_to.frame(<span class=\"hljs-string\">\'myframe2\'</span>)\n<span class=\"hljs-comment\">#定位元素输入值</span>\ndriver.find_element_by_css_selector(<span class=\"hljs-string\">\'#userB\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n</code></div></pre>\n<h3><a id=\"_340\"></a>窗口切换</h3>\n<blockquote>\n<p>selenium默认获取到的是主窗口元素,如果点击跳转到其他窗口则无法操控元素,所以用到了窗口句柄的切换</p>\n<p>1.获取到当前窗口句柄</p>\n<p>2.点击a链接跳转到目的窗口</p>\n<p>3.获取所有的窗口句柄</p>\n<p>4.遍历所有的窗口句柄</p>\n<p>4.1:如果当前窗口是目的窗口则执行代码</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#获取主窗口句柄</span>\ncurrent_handle = driver.current_window_handle\n<span class=\"hljs-comment\">#点击a链接跳转到注册a页面</span>\ndriver.find_element_by_partial_link_text(<span class=\"hljs-string\">\'注册A\'</span>).click()\n<span class=\"hljs-comment\">#获取所有窗口句柄</span>\nhandles = driver.window_handles\n<span class=\"hljs-comment\">#遍历所有的handles句柄判断是不是新打开的窗口</span>\n<span class=\"hljs-keyword\">for</span> handle <span class=\"hljs-keyword\">in</span> handles:\n    <span class=\"hljs-keyword\">if</span> handle!=current_handle:\n        <span class=\"hljs-comment\">#切换到目的窗口</span>\n        driver.switch_to.window(handle)\n        driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#userA\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n        sleep(<span class=\"hljs-number\">3</span>)\n        <span class=\"hljs-comment\"># 密码</span>\n        driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#passwordA\'</span>).send_keys(<span class=\"hljs-string\">\'admin\'</span>)\n</code></div></pre>\n<p>#屏幕截图</p>\n<pre><div class=\"hljs\"><code class=\"lang-python\">driver.get_screenshot_as_file(<span class=\"hljs-string\">f\'../image/<span class=\"hljs-subst\">{time.strftime(<span class=\"hljs-string\">\"%Y_%m_%d %H_%M_%S\"</span>)}</span>.png\'</span>)\n</code></div></pre>\n<h3><a id=\"cookie_377\"></a>cookie的使用</h3>\n<pre><div class=\"hljs\"><code class=\"lang-python\">url=<span class=\"hljs-string\">\'http://www.baidu.com\'</span>\ndriver.get(url)\n<span class=\"hljs-comment\">#设置cookie值</span>\ndriver.add_cookie({<span class=\"hljs-string\">\'name\'</span>:<span class=\"hljs-string\">\'BDUSS\'</span>,<span class=\"hljs-string\">\'value\'</span>:<span class=\"hljs-string\">\'FZSc1l1fkc2SXNrSUNFVUpieEEzcGZ5ZzhIYjZLSXJMT3ZvNkZVMzNtSkhzTVpqRVFBQUFBJCQAAAAAAAAAAAEAAABbQFXPv6iyvLK8tqG1xLnKysIAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAEcjn2NHI59jR\'</span>})\n<span class=\"hljs-comment\">#设置cookie后必须刷新才能生效</span>\ndriver.refresh()\n<span class=\"hljs-comment\">#获取所有cookie值</span>\ncookies = driver.get_cookies()\n<span class=\"hljs-comment\">#根据cookie的name获取值</span>\ncookie = driver.get_cookie(<span class=\"hljs-string\">\'BDUSS\'</span>)\n</code></div></pre>\n<blockquote>\n<p>注：设置cookie后必须刷新才能生效！！！！！</p>\n</blockquote>\n<h2><a id=\"UnitTest_394\"></a>UnitTest测试框架</h2>\n<blockquote>\n<p>TestCase(测试用例)</p>\n<p>注：定义的测试函数前必须有test字符串才能被找到！！！！</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#导包</span>\n<span class=\"hljs-keyword\">import</span> unittest\n\n<span class=\"hljs-comment\">#先定义一个函数</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">sum</span><span class=\"hljs-params\">(x,y)</span>:</span>\n    <span class=\"hljs-keyword\">return</span> x+y\n\n<span class=\"hljs-comment\">#定义一个测试类,继承unitTest</span>\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">testDemo</span><span class=\"hljs-params\">(unittest.TestCase)</span>:</span>\n    <span class=\"hljs-comment\">#定义一个测试方法,实现测试功能,定义的测试函数前必须有test字符串才能被找到</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_sum1</span><span class=\"hljs-params\">(self)</span>:</span>\n        result=sum(<span class=\"hljs-number\">2</span>,<span class=\"hljs-number\">3</span>)\n        print(<span class=\"hljs-string\">\"结果是：\"</span>,result)\n</code></div></pre>\n<blockquote>\n<p>TestSuite(测试套件)：多个测试用例的集合,可以测试单个用例</p>\n<p>TextTestRunner（执行测试套件）</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#导包</span>\n<span class=\"hljs-keyword\">import</span> unittest\n<span class=\"hljs-comment\">#导入需要被测试的类</span>\n<span class=\"hljs-keyword\">from</span> test01 <span class=\"hljs-keyword\">import</span> testDemo\n<span class=\"hljs-comment\">#实例化testsuite</span>\nsuite = unittest.TestSuite()\n<span class=\"hljs-comment\">#添加测试用例到套件里面</span>\n<span class=\"hljs-comment\">#1.类名(函数名),指定类中的指定测试方法</span>\nsuite.addTest(testDemo(<span class=\"hljs-string\">\'test_sum1\'</span>))\n<span class=\"hljs-comment\">#2.添加扩展,搜索testDemo类中test开头的全部测试类</span>\nsuite.addTest(unittest.makeSuite(testDemo))\n<span class=\"hljs-comment\">#将套件添加到TextTestRunner里面执行</span>\nrunner = unittest.TextTestRunner()\nrunner.run(suite)\n</code></div></pre>\n<blockquote>\n<p><mark>TestLoader</mark></p>\n<p>该类下的driver()可以自动搜索指定目录下的指定开头的py文件,执行效率高，返回为套件</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#导包</span>\n<span class=\"hljs-keyword\">import</span> unittest\n<span class=\"hljs-comment\">#调用TestLoader方法，返回套件</span>\nsuite = unittest.defaultTestLoader.discover(<span class=\"hljs-string\">\'../cases\'</span>, pattern=<span class=\"hljs-string\">\'test0*.py\'</span>)\n<span class=\"hljs-comment\">#执行套件方法TextTestRunner</span>\nunittest.TextTestRunner().run(suite)\n</code></div></pre>\n<h4><a id=\"fixture_450\"></a>fixture（装置函数）</h4>\n<blockquote>\n<p>级别：</p>\n<p>​	1.函数级别：setUp，tearDown</p>\n<p>​		注：在每次执行测试用例时都会被执行一次</p>\n<p>​	2.类级别setUpClass。tearDownClass</p>\n<p>​		注：在调用该类会被执行一次开始，一次结束，只能执行一遍，且必须要用@classmethod声明</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">import</span> unittest\n\nb=<span class=\"hljs-number\">1</span>\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Test01</span><span class=\"hljs-params\">(unittest.TestCase)</span>:</span>\n    <span class=\"hljs-comment\">#函数级别setUp，tearDown</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">setUp</span><span class=\"hljs-params\">(self)</span>:</span>\n        print(<span class=\"hljs-string\">\'每个函数执行前都会被执行一次\'</span>)\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">tearDown</span><span class=\"hljs-params\">(self)</span>:</span>\n        print(<span class=\"hljs-string\">\'每个函数执行结束都会被执行一次\'</span>)\n\n    <span class=\"hljs-comment\">#类级别setUpClass。tearDownClass</span>\n<span class=\"hljs-meta\">    @classmethod</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">setUpClass</span><span class=\"hljs-params\">(cls)</span>:</span>\n        print(<span class=\"hljs-string\">\'Test01类被加载之前执行\'</span>)\n<span class=\"hljs-meta\">    @classmethod</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">tearDownClass</span><span class=\"hljs-params\">(cls)</span>:</span>\n        <span class=\"hljs-keyword\">global</span> b\n        b+=<span class=\"hljs-number\">4</span>\n        print(<span class=\"hljs-string\">\'Test01类被加载结束执行\'</span>,b)\n\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_p01</span><span class=\"hljs-params\">(self)</span>:</span>\n        <span class=\"hljs-keyword\">global</span> b\n        b+=<span class=\"hljs-number\">1</span>\n        print(<span class=\"hljs-string\">\'01被执行\'</span>,b)\n\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_p02</span><span class=\"hljs-params\">(self)</span>:</span>\n        <span class=\"hljs-keyword\">global</span> b\n        b+=<span class=\"hljs-number\">1</span>\n        print(<span class=\"hljs-string\">\'02被执行\'</span>,b)\n</code></div></pre>\n<h3><a id=\"_494\"></a>常用断言方法</h3>\n<blockquote>\n<p>1.self.assertEqual(s1,s2)  #断言s1是否等于s2</p>\n<p>2.self.assertIn(s1,s2)     #断言s1是否包含在s2中</p>\n<p>3.self.assertTrue(flag)    #断言flag是否为true</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#常用断言</span>\n<span class=\"hljs-keyword\">import</span> unittest\n\n\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Test01</span><span class=\"hljs-params\">(unittest.TestCase)</span>:</span>\n    <span class=\"hljs-comment\">#开启类加载</span>\n<span class=\"hljs-meta\">    @classmethod</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">setUpClass</span><span class=\"hljs-params\">(cls)</span>:</span>\n        print(<span class=\"hljs-string\">\'开始加载类\'</span>)\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_01</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.assertEqual(<span class=\"hljs-string\">\'123\'</span>,<span class=\"hljs-string\">\'123\'</span>)\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_02</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.assertIn(<span class=\"hljs-string\">\'abcde\'</span>,<span class=\"hljs-string\">\'abcdefg\'</span>)\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_03</span><span class=\"hljs-params\">(self)</span>:</span>\n        flag=<span class=\"hljs-number\">1</span>\n        self.assertTrue(flag)\n</code></div></pre>\n<h3><a id=\"html_521\"></a>生成html测试报告</h3>\n<blockquote>\n<p>需要提前导包才能使用HTMLTestRunner</p>\n<p><mark>HTMLTestRunner(stream=f,title=‘Html测试报告’,verbosity=2,description=‘测试用例执行’,).run(suite)</mark></p>\n<p>在f文件中写入文件流,html标题为…,verbosity为测试结果的信息复杂度（2为详细模式），desciption为测试描述</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#导入HTMLTestRunner模块用于生成测试报告</span>\n<span class=\"hljs-keyword\">import</span> time\n\n<span class=\"hljs-keyword\">import</span> unittest\n\n<span class=\"hljs-keyword\">from</span> HTMLTestRunner.HTMLTestRunner <span class=\"hljs-keyword\">import</span> HTMLTestRunner\n\n<span class=\"hljs-comment\">#通过defaulttestloader下的driver方法找到相应的测试py文件生成套件</span>\nsuite = unittest.defaultTestLoader.discover(<span class=\"hljs-string\">\'../cases\'</span>, pattern=<span class=\"hljs-string\">\'test*.py\'</span>)\n<span class=\"hljs-comment\">#将测试套件执行的结果写入html测试报告中</span>\ntest_dir=(<span class=\"hljs-string\">f\'../files/<span class=\"hljs-subst\">{time.strftime(<span class=\"hljs-string\">\"%Y_%m_%d %H_%M_%S\"</span>)}</span>.html\'</span>)\n<span class=\"hljs-keyword\">with</span> open(test_dir,<span class=\"hljs-string\">\'w\'</span>,encoding=<span class=\"hljs-string\">\'utf-8\'</span>) <span class=\"hljs-keyword\">as</span> f:\n    HTMLTestRunner(stream=f,title=<span class=\"hljs-string\">\'Html测试报告\'</span>,verbosity=<span class=\"hljs-number\">2</span>,description=<span class=\"hljs-string\">\'测试用例执行\'</span>,).run(suite)\n</code></div></pre>\n<h3><a id=\"_547\"></a>参数化应用</h3>\n<blockquote>\n<p>1.需要引入parameterized插件</p>\n<p>​	1）命令行安装  pip install parameterized</p>\n<p>​	2）pycharm安装–》设置–》project</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#需要导入paramated插件</span>\n<span class=\"hljs-keyword\">from</span> parameterized <span class=\"hljs-keyword\">import</span> parameterized\n<span class=\"hljs-keyword\">import</span> unittest\n\n<span class=\"hljs-comment\">#定义测试方法</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add</span><span class=\"hljs-params\">(a,b)</span>:</span>\n    <span class=\"hljs-keyword\">return</span> a+b\n\n<span class=\"hljs-comment\">#获取测试数据</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">data_now</span><span class=\"hljs-params\">()</span>:</span>\n    <span class=\"hljs-keyword\">return</span> [(<span class=\"hljs-number\">1</span>,<span class=\"hljs-number\">2</span>,<span class=\"hljs-number\">3</span>),(<span class=\"hljs-number\">2</span>,<span class=\"hljs-number\">1</span>,<span class=\"hljs-number\">3</span>),(<span class=\"hljs-number\">0</span>,<span class=\"hljs-number\">3</span>,<span class=\"hljs-number\">3</span>)]\n\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Test_01</span><span class=\"hljs-params\">(unittest.TestCase)</span>:</span>\n    <span class=\"hljs-comment\">#使用parameterized插件参数化,用于测试步骤相同且数据较多时</span>\n<span class=\"hljs-meta\">    @parameterized.expand(data_now())</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_add</span><span class=\"hljs-params\">(self,a,b,expect)</span>:</span>\n        result = add(a, b)\n        self.assertEqual(result,expect)\n</code></div></pre>\n<h2><a id=\"_576\"></a>案例</h2>\n<p><img src=\"C:%5CUsers%5C33535%5CAppData%5CRoaming%5CTypora%5Ctypora-user-images%5Cimage-20221220160220486.png\" alt=\"image-20221220160220486\" /></p>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#先导包</span>\n<span class=\"hljs-keyword\">import</span> time\n\n<span class=\"hljs-keyword\">from</span> selenium <span class=\"hljs-keyword\">import</span> webdriver\n<span class=\"hljs-keyword\">import</span> unittest\n<span class=\"hljs-keyword\">from</span> time <span class=\"hljs-keyword\">import</span> sleep\n<span class=\"hljs-comment\">#定义测试类</span>\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Login_test</span><span class=\"hljs-params\">(unittest.TestCase)</span>:</span>\n    <span class=\"hljs-comment\">#测试函数执行前</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">setUp</span><span class=\"hljs-params\">(self)</span>:</span>\n        <span class=\"hljs-comment\">#获取驱动</span>\n        self.drive = webdriver.Chrome()\n        <span class=\"hljs-comment\">#跳转到网站</span>\n        self.drive.get(<span class=\"hljs-string\">\'https://demo6.tp-shop.cn/\'</span>)\n        <span class=\"hljs-comment\">#全屏，隐式等待</span>\n        self.drive.maximize_window()\n        self.drive.implicitly_wait(<span class=\"hljs-number\">20</span>)\n    <span class=\"hljs-comment\">#定义测试函数</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test_login</span><span class=\"hljs-params\">(self)</span>:</span>\n        driver = self.drive\n        <span class=\"hljs-comment\">#点击登录按钮</span>\n        driver.find_element_by_partial_link_text(<span class=\"hljs-string\">\'登录\'</span>).click()\n        <span class=\"hljs-comment\">#输入账号密码，验证码为空</span>\n        driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#username\'</span>).send_keys(<span class=\"hljs-string\">\'18537683875\'</span>)\n        driver.find_element_by_css_selector(<span class=\"hljs-string\">\'#password\'</span>).send_keys(<span class=\"hljs-string\">\'12345\'</span>)\n        <span class=\"hljs-comment\">#点击登录获取弹出框的值</span>\n        driver.find_element_by_css_selector(<span class=\"hljs-string\">\'.J-login-submit\'</span>).click()\n        result = driver.find_element_by_css_selector(<span class=\"hljs-string\">\'.layui-layer-content\'</span>).text\n        sleep(<span class=\"hljs-number\">3</span>)\n        <span class=\"hljs-comment\">#预期值与实际值进行对比（try-except）</span>\n        <span class=\"hljs-keyword\">try</span>:\n            self.assertEqual(<span class=\"hljs-string\">\'验证码不能为空!\'</span>,result)\n        <span class=\"hljs-keyword\">except</span> AssertionError:\n            driver.get_screenshot_as_file(<span class=\"hljs-string\">f\'../<span class=\"hljs-subst\">{time.strftime(<span class=\"hljs-string\">\"%Y_%m_%d %H_%M_%S\"</span>)}</span>.png\'</span>)\n            print(<span class=\"hljs-string\">\'弹出的结果为：\'</span>,result)\n            <span class=\"hljs-comment\">#将异常再次抛出</span>\n            <span class=\"hljs-keyword\">raise</span>\n\n    <span class=\"hljs-comment\">#定义结束</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">tearDown</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.drive.quit()\n</code></div></pre>\n<h3><a id=\"po_623\"></a>使用po模式</h3>\n<blockquote>\n<p>批量添加导航栏</p>\n</blockquote>\n<p>BasePage</p>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">from</span> selenium <span class=\"hljs-keyword\">import</span> webdriver\n<span class=\"hljs-keyword\">from</span> selenium.webdriver.support.wait <span class=\"hljs-keyword\">import</span> WebDriverWait\n\n\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Base</span><span class=\"hljs-params\">()</span>:</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">__init__</span><span class=\"hljs-params\">(self,driver=None)</span>:</span>\n        <span class=\"hljs-keyword\">if</span> driver!=<span class=\"hljs-keyword\">None</span>:\n            self.driver = driver\n        <span class=\"hljs-keyword\">else</span>:\n            self.driver = webdriver.Chrome()\n            self.driver.implicitly_wait(<span class=\"hljs-number\">30</span>)\n            self.driver.maximize_window()\n            self.driver.get(<span class=\"hljs-string\">\"http://localhost:81/index.php/Admin/Admin/login\"</span>)\n\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">base_element</span><span class=\"hljs-params\">(self,loc)</span>:</span>\n        <span class=\"hljs-keyword\">return</span> WebDriverWait(self.driver,timeout=<span class=\"hljs-number\">30</span>,poll_frequency=<span class=\"hljs-number\">5</span>).until(<span class=\"hljs-keyword\">lambda</span> x:x.find_element(*loc))\n\n    <span class=\"hljs-comment\">#输入</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">base_input</span><span class=\"hljs-params\">(self,loc,value)</span>:</span>\n        ipt = self.base_element(loc)\n        ipt.clear()\n        ipt.send_keys(value)\n    <span class=\"hljs-comment\">#点击</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">base_click</span><span class=\"hljs-params\">(self,loc)</span>:</span>\n        self.base_element(loc).click()\n    <span class=\"hljs-comment\">#获取文本值</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">base_text</span><span class=\"hljs-params\">(self,loc)</span>:</span>\n        text = self.base_element(loc).text\n        <span class=\"hljs-keyword\">return</span> text\n    <span class=\"hljs-comment\">#截图</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">base_img</span><span class=\"hljs-params\">(self,pathfile)</span>:</span>\n        self.driver.get_screenshot_as_file(pathfile)\n</code></div></pre>\n<p>LoginPage</p>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">import</span> time\n\n<span class=\"hljs-keyword\">from</span> selenium.webdriver.common.by <span class=\"hljs-keyword\">import</span> By\n\n<span class=\"hljs-keyword\">from</span> com.PoTest.Page.BasePage <span class=\"hljs-keyword\">import</span> Base\nLogin_username=By.NAME,<span class=\"hljs-string\">\"username\"</span>\nLogin_password=By.NAME,<span class=\"hljs-string\">\"password\"</span>\nLogin_vertify=By.NAME,<span class=\"hljs-string\">\"vertify\"</span>\nLogin_btn=By.CLASS_NAME,<span class=\"hljs-string\">\"sub\"</span>\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Login</span><span class=\"hljs-params\">(Base)</span>:</span>\n    <span class=\"hljs-comment\">#输入用户名</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">login_username</span><span class=\"hljs-params\">(self,username)</span>:</span>\n        self.base_input(Login_username,username)\n    <span class=\"hljs-comment\">#输入密码</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">login_password</span><span class=\"hljs-params\">(self,password)</span>:</span>\n        self.base_input(Login_password,password)\n    <span class=\"hljs-comment\">#输入验证码</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">login_vertify</span><span class=\"hljs-params\">(self,vertify)</span>:</span>\n        self.base_input(Login_vertify,vertify)\n    <span class=\"hljs-comment\">#点击登录</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">login_btn</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.base_click(Login_btn)\n    <span class=\"hljs-comment\">#总和</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">login_all</span><span class=\"hljs-params\">(self,username,password,vertify)</span>:</span>\n        self.login_username(username)\n        self.login_password(password)\n        self.login_vertify(vertify)\n        time.sleep(<span class=\"hljs-number\">3</span>)\n        self.login_btn()\n\n<span class=\"hljs-comment\"># if __name__==\"__main__\":</span>\n<span class=\"hljs-comment\">#     login = Login()</span>\n<span class=\"hljs-comment\">#     login.login_all(\"admin\",\"123456\",\"8888\")</span>\n</code></div></pre>\n<p>AddPage</p>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">import</span> time\n\n<span class=\"hljs-keyword\">from</span> selenium.webdriver.common.by <span class=\"hljs-keyword\">import</span> By\n<span class=\"hljs-keyword\">from</span> selenium.webdriver.support.select <span class=\"hljs-keyword\">import</span> Select\n\n<span class=\"hljs-keyword\">from</span> com.PoTest.Page.LoginPage <span class=\"hljs-keyword\">import</span> Login\nAdd_banner=By.XPATH,<span class=\"hljs-string\">\"/html/body/div[1]/div[4]/ul/li[1]/a\"</span>\nAdd_list=By.LINK_TEXT,<span class=\"hljs-string\">\"自定义导航栏\"</span>\nAdd_btn=By.CSS_SELECTOR,<span class=\"hljs-string\">\"[href=\'/index.php/Admin/System/addEditNav\']\"</span>  <span class=\"hljs-comment\">#frame id=workspace</span>\nAdd_order=By.ID,<span class=\"hljs-string\">\"sort\"</span>\nAdd_submit=By.ID,<span class=\"hljs-string\">\"submitBtn\"</span>\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">Add</span><span class=\"hljs-params\">(Login)</span>:</span>\n    <span class=\"hljs-comment\">#点击系统</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add_banner</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.base_click(Add_banner)\n    <span class=\"hljs-comment\">#点击自定义导航栏</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add_list</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.base_click(Add_list)\n    <span class=\"hljs-comment\">#点击新增导航</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add_btn</span><span class=\"hljs-params\">(self)</span>:</span>\n        <span class=\"hljs-comment\">#由于是frame框架</span>\n        time.sleep(<span class=\"hljs-number\">3</span>)\n        frame1 = self.driver.find_element_by_id(<span class=\"hljs-string\">\"workspace\"</span>)\n        self.driver.switch_to.frame(frame1)\n        self.base_click(Add_btn)\n    <span class=\"hljs-comment\">#选择下拉框</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add_sel</span><span class=\"hljs-params\">(self,index)</span>:</span>\n        sel = self.driver.find_element_by_id(<span class=\"hljs-string\">\"system_nav\"</span>)\n        select = Select(sel)\n        select.select_by_index(index)\n    <span class=\"hljs-comment\">#输入值</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add_sort</span><span class=\"hljs-params\">(self,sort)</span>:</span>\n        self.base_input(Add_order,sort)\n    <span class=\"hljs-comment\">#确认</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add_submit</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.base_click(Add_submit)\n\n    <span class=\"hljs-comment\">#集合</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">add_all</span><span class=\"hljs-params\">(self,index,sort)</span>:</span>\n        Login.login_all(self,<span class=\"hljs-string\">\"admin\"</span>,<span class=\"hljs-string\">\"123456\"</span>,<span class=\"hljs-string\">\"8888\"</span>)\n        self.add_banner()\n        self.add_list()\n        self.add_btn()\n        self.add_sel(index)\n        self.add_sort(sort)\n        time.sleep(<span class=\"hljs-number\">3</span>)\n        self.add_submit()\n\n<span class=\"hljs-comment\"># if __name__==\"__main__\":</span>\n<span class=\"hljs-comment\">#     add = Add()</span>\n<span class=\"hljs-comment\">#     add.add_all(1,\"2\")</span>\n</code></div></pre>\n<p>test里面的csv读取</p>\n<p>csvv</p>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">import</span> csv\n\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">csvv</span><span class=\"hljs-params\">(filepath)</span>:</span>\n    <span class=\"hljs-keyword\">with</span> open(filepath,<span class=\"hljs-string\">\"r\"</span>,encoding=<span class=\"hljs-string\">\"utf-8\"</span>) <span class=\"hljs-keyword\">as</span> f:\n        reader = csv.reader(f)\n        list01=[]\n        j=<span class=\"hljs-number\">0</span>\n        <span class=\"hljs-keyword\">for</span> i <span class=\"hljs-keyword\">in</span> reader:\n            <span class=\"hljs-keyword\">if</span> j!=<span class=\"hljs-number\">0</span>:\n                list01.append(tuple(i))\n            <span class=\"hljs-keyword\">else</span>:\n                <span class=\"hljs-keyword\">pass</span>\n            j+=<span class=\"hljs-number\">1</span>\n        <span class=\"hljs-keyword\">return</span> list01\n\n\n<span class=\"hljs-comment\"># l = csvv(\"datacsv01.csv\")</span>\n<span class=\"hljs-comment\"># print(l)</span>\n</code></div></pre>\n<p>test_Add</p>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">import</span> unittest\n\n<span class=\"hljs-keyword\">from</span> com.PoTest.Page.AddPage <span class=\"hljs-keyword\">import</span> Add\n<span class=\"hljs-keyword\">from</span> ddt <span class=\"hljs-keyword\">import</span> ddt,unpack,data\n<span class=\"hljs-keyword\">from</span> csvv <span class=\"hljs-keyword\">import</span> csvv\n<span class=\"hljs-meta\">@ddt</span>\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">test</span><span class=\"hljs-params\">(unittest.TestCase)</span>:</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">setUp</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.add = Add()\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">tearDown</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.add.driver.quit()\n\n<span class=\"hljs-meta\">    @data(*csvv(\"datacsv01.csv\"))</span>\n<span class=\"hljs-meta\">    @unpack</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">test01</span><span class=\"hljs-params\">(self,index,order)</span>:</span>\n        self.add.add_all(index,order)\n\n<span class=\"hljs-keyword\">if</span> __name__==<span class=\"hljs-string\">\"__main__\"</span>:\n    unittest.main()\n\n</code></div></pre>\n<p>数据</p>\n<p><img src=\"C:%5CUsers%5C33535%5CAppData%5CRoaming%5CTypora%5Ctypora-user-images%5Cimage-20230421160627597.png\" alt=\"image-20230421160627597\" /></p>\n<h2><a id=\"_813\"></a>数据驱动</h2>\n<h3><a id=\"json_815\"></a>json使用</h3>\n<blockquote>\n<p>将json字符串转换为字典</p>\n<p>1).json.dumps()</p>\n<p>将字典转换为json字符串</p>\n<p>2).json.loads()</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-comment\">#将json字符串转换为字典</span>\njdata2=<span class=\"hljs-string\">\'{\"name\":\"zy\",\"age\":18}\'</span>\ndata_dict2 = json.loads(jdata2)\n<span class=\"hljs-comment\">#将字典转换为json字符串</span>\ndata_dict={<span class=\"hljs-string\">\'name\'</span>:<span class=\"hljs-string\">\'zy\'</span>,<span class=\"hljs-string\">\'age\'</span>:<span class=\"hljs-number\">18</span>}\njdata = json.dumps(data_dict)\n</code></div></pre>\n<blockquote>\n<p>写入json文件</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\">data_dict={<span class=\"hljs-string\">\'name\'</span>:<span class=\"hljs-string\">\'zy\'</span>,<span class=\"hljs-string\">\'age\'</span>:<span class=\"hljs-number\">18</span>}\n<span class=\"hljs-keyword\">with</span> open(<span class=\"hljs-string\">\'./jsonfile/file01.json\'</span>,<span class=\"hljs-string\">\'w\'</span>,encoding=<span class=\"hljs-string\">\'utf-8\'</span>) <span class=\"hljs-keyword\">as</span> f:\n    json.dump(data_dict,f)\n    \n<span class=\"hljs-comment\">#读取json文件使用load结果为字典</span>\n</code></div></pre>\n<h2><a id=\"csv_844\"></a>读取csv文件</h2>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">csvopenfile</span><span class=\"hljs-params\">(filename)</span>:</span>\n    filepath=<span class=\"hljs-string\">\"../../../files/\"</span>+filename\n    arr=[]\n    <span class=\"hljs-keyword\">with</span> open(filepath,<span class=\"hljs-string\">\'r\'</span>,encoding=<span class=\"hljs-string\">\'utf-8\'</span>) <span class=\"hljs-keyword\">as</span> f:\n        f_csv = csv.reader(f)\n        <span class=\"hljs-keyword\">for</span> r <span class=\"hljs-keyword\">in</span> f_csv:\n            arr.append(tuple(r))\n        print(arr)\ncsvopenfile(<span class=\"hljs-string\">\"ces.csv\"</span>)\n<span class=\"hljs-comment\">#[(1, 2, \'3\'), (168, 170, \'338\')]</span>\n</code></div></pre>\n<h3><a id=\"tips_859\"></a>小tips</h3>\n<blockquote>\n<p>日期控件显示readonly该怎么办?</p>\n<p>解决方法:使用js删除只读属性</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-js\"><span class=\"hljs-built_in\">document</span>.getElementById(<span class=\"hljs-string\">\"date\"</span>).removeAttribute(<span class=\"hljs-string\">\"readonly\"</span>)\n</code></div></pre>\n<blockquote>\n<p>把滚动条拉到最底部该怎么做?</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">from</span> selenium <span class=\"hljs-keyword\">import</span> webdriver\n\nbrowser = webdriver.Chrome() <span class=\"hljs-comment\"># 创建浏览器对象</span>\nbrowser.execute_script(\n    <span class=\"hljs-string\">\'window.scrollTo(0,document.body.scrollHeight)\'</span>\n) <span class=\"hljs-comment\"># 把滚动条拉到最底部</span>\n</code></div></pre>\n<h3><a id=\"ddt_880\"></a>ddt</h3>\n<blockquote>\n<p>使用ddt将读取到的csv数据参数化</p>\n</blockquote>\n<p><code>读取csv文件函数</code></p>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">import</span> csv\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">csvv</span><span class=\"hljs-params\">(filepath)</span>:</span>\n    <span class=\"hljs-keyword\">with</span> open(filepath,<span class=\"hljs-string\">\"r\"</span>,encoding=<span class=\"hljs-string\">\"utf-8\"</span>) <span class=\"hljs-keyword\">as</span> f:\n        reader = csv.reader(f)\n        list01=[]\n        j=<span class=\"hljs-number\">0</span>\n        <span class=\"hljs-keyword\">for</span> i <span class=\"hljs-keyword\">in</span> reader:\n            <span class=\"hljs-keyword\">if</span> j!=<span class=\"hljs-number\">0</span>:\n                list01.append(tuple(i))\n            <span class=\"hljs-keyword\">else</span>:\n                <span class=\"hljs-keyword\">pass</span>\n            j+=<span class=\"hljs-number\">1</span>\n        <span class=\"hljs-keyword\">return</span> list01\n\n<span class=\"hljs-comment\">#返回的数据如下</span>\n[(<span class=\"hljs-string\">\'niu\'</span>, <span class=\"hljs-string\">\'123\'</span>, <span class=\"hljs-string\">\'123\'</span>, <span class=\"hljs-string\">\'success！\'</span>), (<span class=\"hljs-string\">\'niu\'</span>, <span class=\"hljs-string\">\'123\'</span>, <span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'success！\'</span>), (<span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'123\'</span>, <span class=\"hljs-string\">\'123\'</span>, <span class=\"hljs-string\">\'用户名不能为空！\'</span>), (<span class=\"hljs-string\">\'niu\'</span>, <span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'123\'</span>, <span class=\"hljs-string\">\'密码不能为空！\'</span>), (<span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'123\'</span>, <span class=\"hljs-string\">\'用户名和密码错误！\'</span>), (<span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'\'</span>, <span class=\"hljs-string\">\'用户名和密码错误！\'</span>)]\n</code></div></pre>\n<blockquote>\n<p>测试类</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\"><span class=\"hljs-keyword\">import</span> unittest\n\n<span class=\"hljs-keyword\">from</span> ddt <span class=\"hljs-keyword\">import</span> ddt, data,unpack\n<span class=\"hljs-keyword\">from</span> selenium <span class=\"hljs-keyword\">import</span> webdriver\n<span class=\"hljs-keyword\">import</span> time\n<span class=\"hljs-keyword\">from</span> com.kabu.test.test03.csvv <span class=\"hljs-keyword\">import</span> csvv\n\n<span class=\"hljs-meta\">@ddt												#在一个测试类上使用@ddt装饰器时，ddt库会自动为该测试类生成多个测试函数</span>\n<span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">test01_01</span><span class=\"hljs-params\">(unittest.TestCase)</span>:</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">setUp</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.driver = webdriver.Chrome()\n        self.driver.implicitly_wait(<span class=\"hljs-number\">3</span>)\n        self.driver.maximize_window()\n        url=<span class=\"hljs-string\">\"http://127.0.0.1:8020/selenium%E7%BB%83%E4%B9%A0/test02.html?__hbt=1681031952063\"</span>\n        self.driver.get(url)\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">tearDown</span><span class=\"hljs-params\">(self)</span>:</span>\n        self.driver.quit()\n\n<span class=\"hljs-meta\">    @data(*csvv(\"testdata01.csv\"))								#读取全部数据</span>\n<span class=\"hljs-meta\">    @unpack														#解包,将每个元组当成一条数据</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">def</span> <span class=\"hljs-title\">testuser</span><span class=\"hljs-params\">(self,username,psd,zhu,expect)</span>:</span>					<span class=\"hljs-comment\">#将每个元组的四个字段分别赋值</span>\n        driver=self.driver\n        driver.find_element_by_id(<span class=\"hljs-string\">\"username\"</span>).send_keys(username)\n        driver.find_element_by_id(<span class=\"hljs-string\">\"psd\"</span>).send_keys(psd)\n        driver.find_element_by_id(<span class=\"hljs-string\">\"beizhu\"</span>).send_keys(zhu)\n        driver.find_element_by_id(<span class=\"hljs-string\">\"sub\"</span>).click()\n        time.sleep(<span class=\"hljs-number\">3</span>)\n        result = driver.find_element_by_xpath(<span class=\"hljs-string\">\"//*[@id=\'content\']/p\"</span>).text\n        <span class=\"hljs-keyword\">try</span>:\n            self.assertEqual(expect,result)\n        <span class=\"hljs-keyword\">except</span> AssertionError:\n            driver.get_screenshot_as_file(<span class=\"hljs-string\">\"../img/error.png\"</span>)\n            <span class=\"hljs-keyword\">raise</span>\n\n<span class=\"hljs-keyword\">if</span> __name__==<span class=\"hljs-string\">\"__main__\"</span>:\n    unittest.main()\n</code></div></pre>\n<blockquote>\n<p>注意弹窗中的换行符</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-python\">result = alert.text.replace(<span class=\"hljs-string\">\"\\n\"</span>,<span class=\"hljs-string\">\"\"</span>)\n</code></div></pre>\n', 1730418106799276034);
INSERT INTO `ms_article_body` VALUES (1730418377826811907, '数据库是结构化信息或数据的有序集合，一般以电子形式存储在计算机系统中。通常由数据库管理系统 (DBMS) 来控制。在现实中，数据、DBMS 及关联应用一起被称为数据库系统，通常简称为数据库。\n\n为了提高数据处理和查询效率，当今最常见的数据库通常以行和列的形式将数据存储在一系列的表中，支持用户便捷地访问、管理、修改、更新、控制和组织数据。另外，大多数数据库都使用结构化查询语言 (SQL) 来编写和查询数据。', '<p>数据库是结构化信息或数据的有序集合，一般以电子形式存储在计算机系统中。通常由数据库管理系统 (DBMS) 来控制。在现实中，数据、DBMS 及关联应用一起被称为数据库系统，通常简称为数据库。</p>\n<p>为了提高数据处理和查询效率，当今最常见的数据库通常以行和列的形式将数据存储在一系列的表中，支持用户便捷地访问、管理、修改、更新、控制和组织数据。另外，大多数数据库都使用结构化查询语言 (SQL) 来编写和查询数据。</p>\n', 1730418377826811905);
INSERT INTO `ms_article_body` VALUES (1730418549340291075, '数据库是存放数据的仓库。它的存储空间很大，可以存放百万条、千万条、上亿条数据。但是数据库并不是随意地将数据进行存放，是有一定的规则的，否则查询的效率会很低。当今世界是一个充满着数据的互联网世界，充斥着大量的数据。即这个互联网世界就是数据世界。数据的来源有很多，比如出行记录、消费记录、浏览的网页、发送的消息等等。除了文本类型的数据，图像、音乐、声音都是数据。\n数据库是一个按数据结构来存储和管理数据的计算机软件系统。数据库的概念实际包括两层意思：\n（1）数据库是一个实体，它是能够合理保管数据的“仓库”，用户在该“仓库”中存放要管理的事务数据，“数据”和“库”两个概念结合成为数据库。\n（2）数据库是数据管理的新方法和技术，它能更合适的组织数据、更方便的维护数据、更严密的控制数据和更有效的利用数据。\n数据库作为最重要的基础软件，是确保计算机系统稳定运行的基石。 [2]\n发展现状\n在数据库的发展历史上，数据库先后经历了层次数据库、网状数据库和关系数据库等各个阶段的发展，数据库技术在各个方面的快速的发展。特别是关系型数据库已经成为目前数据库产品中最重要的一员，80年代以来， 几乎所有的数据库厂商新出的数据库产品都支持关系型数据库，即使一些非关系数据库产品也几乎都有支持关系数据库的接口。这主要是传统的关系型数据库可以比较好的解决管理和存储关系型数据的问题。随着云计算的发展和大数据时代的到来，关系型数据库越来越无法满足需要，这主要是由于越来越多的半关系型和非关系型数据需要用数据库进行存储管理，以此同时，分布式技术等新技术的出现也对数据库的技术提出了新的要求，于是越来越多的非关系型数据库就开始出现，这类数据库与传统的关系型数据库在设计和数据结构有了很大的不同， 它们更强调数据库数据的高并发读写和存储大数据，这类数据库一般被称为NoSQL（Not only SQL）数据库。 而传统的关系型数据库在一些传统领域依然保持了强大的生命力。', '<p>数据库是存放数据的仓库。它的存储空间很大，可以存放百万条、千万条、上亿条数据。但是数据库并不是随意地将数据进行存放，是有一定的规则的，否则查询的效率会很低。当今世界是一个充满着数据的互联网世界，充斥着大量的数据。即这个互联网世界就是数据世界。数据的来源有很多，比如出行记录、消费记录、浏览的网页、发送的消息等等。除了文本类型的数据，图像、音乐、声音都是数据。<br />\n数据库是一个按数据结构来存储和管理数据的计算机软件系统。数据库的概念实际包括两层意思：<br />\n（1）数据库是一个实体，它是能够合理保管数据的“仓库”，用户在该“仓库”中存放要管理的事务数据，“数据”和“库”两个概念结合成为数据库。<br />\n（2）数据库是数据管理的新方法和技术，它能更合适的组织数据、更方便的维护数据、更严密的控制数据和更有效的利用数据。<br />\n数据库作为最重要的基础软件，是确保计算机系统稳定运行的基石。 [2]<br />\n发展现状<br />\n在数据库的发展历史上，数据库先后经历了层次数据库、网状数据库和关系数据库等各个阶段的发展，数据库技术在各个方面的快速的发展。特别是关系型数据库已经成为目前数据库产品中最重要的一员，80年代以来， 几乎所有的数据库厂商新出的数据库产品都支持关系型数据库，即使一些非关系数据库产品也几乎都有支持关系数据库的接口。这主要是传统的关系型数据库可以比较好的解决管理和存储关系型数据的问题。随着云计算的发展和大数据时代的到来，关系型数据库越来越无法满足需要，这主要是由于越来越多的半关系型和非关系型数据需要用数据库进行存储管理，以此同时，分布式技术等新技术的出现也对数据库的技术提出了新的要求，于是越来越多的非关系型数据库就开始出现，这类数据库与传统的关系型数据库在设计和数据结构有了很大的不同， 它们更强调数据库数据的高并发读写和存储大数据，这类数据库一般被称为NoSQL（Not only SQL）数据库。 而传统的关系型数据库在一些传统领域依然保持了强大的生命力。</p>\n', 1730418549273182209);
INSERT INTO `ms_article_body` VALUES (1730418716651077636, '![壁纸.jpg](http://s4v44faoz.hn-bkt.clouddn.com/39bb1366-5348-4491-99ea-ff4d47afa057.jpg)', '<p><img src=\"http://s4v44faoz.hn-bkt.clouddn.com/39bb1366-5348-4491-99ea-ff4d47afa057.jpg\" alt=\"壁纸.jpg\" /></p>\n', 1730418716651077634);
INSERT INTO `ms_article_body` VALUES (1730418943172853764, '# ssm框架\n\n## Spring整合mybatis\n\n1. 第一步:首先需要在pom.xml导入依赖\n\n   > 1.spring-context\n   >\n   > 2.spring-jdbc\n   >\n   > 3.mysql-connector-java\n   >\n   > 4.mybatis\n   >\n   > 5.mybatis-spring\n   >\n   > 6.druid  #引入连接池\n   >\n   > 6.junit\n\n2. 第二步:创建文件,编写pojo对象\n	\n	> 创建以下package包\n	>\n	> mapper,pojo,service\n	>\n	> 1.pojo类对象中需要编写数据库中的字段名\n	\n3. 配置mapper接口文件\n\n   ```java\n   public interface AccountMapper {//该接口的实现类不需要实现,使用spring的动态代理可以实现\n   \n   //    增\n       int insert(Account account);\n   //    删\n       int deleteByaton(String accountname);\n   //    改\n       int update(Account account);\n   //    查询,查询单个结果\n       Account selectByaton(String accuntname);\n   //    查询所有结果\n       List<Account> selectAll();\n   }\n   ```\n	4.配置mybatis映射文件\n	\n	> 注意此映射文件路径需要与src/mapper文件路径一致\n	>\n	> 新建的为文件,==多级文件创建格式为-----com/kabu/bank==', '<h1><a id=\"ssm_0\"></a>ssm框架</h1>\n<h2><a id=\"Springmybatis_2\"></a>Spring整合mybatis</h2>\n<ol>\n<li>\n<p>第一步:首先需要在pom.xml导入依赖</p>\n<blockquote>\n<p>1.spring-context</p>\n<p>2.spring-jdbc</p>\n<p>3.mysql-connector-java</p>\n<p>4.mybatis</p>\n<p>5.mybatis-spring</p>\n<p>6.druid  #引入连接池</p>\n<p>6.junit</p>\n</blockquote>\n</li>\n<li>\n<p>第二步:创建文件,编写pojo对象</p>\n<blockquote>\n<p>创建以下package包</p>\n<p>mapper,pojo,service</p>\n<p>1.pojo类对象中需要编写数据库中的字段名</p>\n</blockquote>\n</li>\n<li>\n<p>配置mapper接口文件</p>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">interface</span> <span class=\"hljs-title\">AccountMapper</span> </span>{<span class=\"hljs-comment\">//该接口的实现类不需要实现,使用spring的动态代理可以实现</span>\n\n<span class=\"hljs-comment\">//    增</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">insert</span><span class=\"hljs-params\">(Account account)</span></span>;\n<span class=\"hljs-comment\">//    删</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">deleteByaton</span><span class=\"hljs-params\">(String accountname)</span></span>;\n<span class=\"hljs-comment\">//    改</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">int</span> <span class=\"hljs-title\">update</span><span class=\"hljs-params\">(Account account)</span></span>;\n<span class=\"hljs-comment\">//    查询,查询单个结果</span>\n    <span class=\"hljs-function\">Account <span class=\"hljs-title\">selectByaton</span><span class=\"hljs-params\">(String accuntname)</span></span>;\n<span class=\"hljs-comment\">//    查询所有结果</span>\n    <span class=\"hljs-function\">List&lt;Account&gt; <span class=\"hljs-title\">selectAll</span><span class=\"hljs-params\">()</span></span>;\n}\n</code></div></pre>\n<p>4.配置mybatis映射文件</p>\n<blockquote>\n<p>注意此映射文件路径需要与src/mapper文件路径一致</p>\n<p>新建的为文件,<mark>多级文件创建格式为-----com/kabu/bank</mark></p>\n</blockquote>\n</li>\n</ol>\n', 1730418943172853762);
INSERT INTO `ms_article_body` VALUES (1730419172848746498, '# ajax\n\n## 案例1：动态下拉列表\n\n> 前端页面\n\n```javascript\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <title>省市联动</title>\n</head>\n<body>\n\n<!--引入我们自己编写的jQuery库-->\n<script type=\"text/javascript\" src=\"jQuery.min.js\"></script>\n<script type=\"text/javascript\">\n    $(function(){\n        // 发送ajax请求，获取所有的省份。省份的pcode是null\n        $.ajax({\n            type : \"get\",\n            url : \"/test1/require7\",\n            data : \"t=\" + new Date().getTime(),\n            async : true,\n            success : function(jsonArr){\n                //传过来的为string对象需要通过eval函数转化为json对象才可以使用\n                alert(jsonArr);\n                console.log(typeof jsonArr);\n                var msg = eval(\"(\" + jsonArr + \")\");\n                console.log(msg);\n                // [{\"code\":\"001\", \"name\":\"河北省\"},{\"code\":\"002\", \"name\":\"河南省\"}]\n                // 以上格式的json是我们自己设计出来的，希望服务器能够给我们返回这样一个json格式的字符串。\n                var html = \"<option value=\'\'>--请选择省份--</option>\";\n                for (var i = 0; i < msg.length; i++) {\n                    var area = msg[i]\n                    html += \"<option value=\'\"+area.num+\"\'>\"+area.name+\"</option>\"\n                }\n                $(\"#province\").html(html)\n            }\n        })\n\n        // 只要change发生，就发送ajax请求\n        $(\"#province\").change(function(){\n            //alert(\"发送ajax请求\")\n            //alert(this)\n            //alert(this.value)\n\n            // 发送ajax请求\n            $.ajax({\n                type : \"get\",\n                url : \"/test1/require7\",\n                data : \"t=\" + new Date().getTime() + \"&pcnum=\" + this.value,\n                async : true,\n                success : function(jsonArr){\n                    // [{\"code\":\"006\", \"name\":\"XXX\"},{\"code\":\"008\", \"name\":\"YYYY\"}]\n                    var msg = eval(\"(\" + jsonArr + \")\");\n                    var html = \"<option value=\'\'>--请选择市--</option>\";\n                    for (var i = 0; i < msg.length; i++) {\n                        var area = msg[i]\n                        html += \"<option value=\'\"+area.num+\"\'>\"+area.name+\"</option>\"\n                    }\n                    $(\"#city\").html(html)\n                }\n            })\n        })\n    })\n</script>\n\n<select id=\"province\">\n    <!--<option value=\"\">&#45;&#45;请选择省份&#45;&#45;</option>\n    <option value=\"001\">河北省</option>\n    <option value=\"002\">河南省</option>-->\n</select>\n\n<select id=\"city\"></select>\n\n</body>\n</html>\n```\n\n> 后端页面(此处省略了area的bean对象)\n\n```java\npackage com.kabu.ajax.sevelet;\n\nimport com.alibaba.fastjson.JSON;\nimport com.kabu.ajax.beans.area;\n\nimport javax.servlet.ServletException;\nimport javax.servlet.annotation.WebServlet;\nimport javax.servlet.http.HttpServlet;\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\nimport java.io.IOException;\nimport java.io.PrintWriter;\nimport java.sql.*;\nimport java.util.ArrayList;\nimport java.util.List;\n@WebServlet(\"/require7\")\npublic class ajaxservlet7 extends HttpServlet {\n    @Override\n    protected void doGet(HttpServletRequest req, HttpServletResponse resp) throws ServletException, IOException {\n        //判断是否改变下拉列表\n        String pcnum = req.getParameter(\"pcnum\");\n        //连接数据库\n        Connection conn=null;\n        PreparedStatement pre=null;\n        ResultSet res=null;\n        List<area> arealist=new ArrayList<area>();\n        try{\n            Class.forName(\"com.mysql.cj.jdbc.Driver\");\n            conn= DriverManager.getConnection(\"jdbc:mysql://localhost:3306/bjpowernode?useSSL=false&serverTimezone=UTC\",\"root\",\"abc666666\");\n            String sql=\"\";\n            System.out.println(\"连接成功\");\n            if(pcnum==null){\n                sql=\"select num,name from t_list where pcnum is null\";\n                pre=conn.prepareStatement(sql);\n            }else{\n                sql=\"select num,name from t_list where pcnum=?\";\n                pre=conn.prepareStatement(sql);\n                pre.setString(1,pcnum);\n            }\n            //执行sql\n            res=pre.executeQuery();\n            //处理结果集\n            while (res.next()){\n                String num = res.getString(\"num\");\n                String name = res.getString(\"name\");\n                area a = new area(num, name);\n                arealist.add(a);\n            }\n        }catch (Exception e){\n            e.printStackTrace();\n        }finally {\n            if(res!=null){\n                try {\n                    res.close();\n                } catch (Exception e) {\n                    e.printStackTrace();\n                }\n            }\n            if(pre!=null){\n                try {\n                    pre.close();\n                } catch (Exception e) {\n                    e.printStackTrace();\n                }\n            }\n            if(conn!=null){\n                try {\n                    conn.close();\n                } catch (Exception e) {\n                    e.printStackTrace();\n                }\n            }\n        }\n        resp.setContentType(\"text/html;charset=UTF-8\");\n        PrintWriter out = resp.getWriter();\n        //使用fastjason将java对象转换为json对象\n        String json = JSON.toJSONString(arealist);\n        //输出json\n        out.print(json);\n    }\n}\n```\n\n', '<h1><a id=\"ajax_0\"></a>ajax</h1>\n<h2><a id=\"1_2\"></a>案例1：动态下拉列表</h2>\n<blockquote>\n<p>前端页面</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-javascript\">&lt;!DOCTYPE html&gt;\n<span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">html</span> <span class=\"hljs-attr\">lang</span>=<span class=\"hljs-string\">\"en\"</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">head</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">meta</span> <span class=\"hljs-attr\">charset</span>=<span class=\"hljs-string\">\"UTF-8\"</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">title</span>&gt;</span>省市联动<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">title</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">head</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">body</span>&gt;</span>\n\n<span class=\"hljs-comment\">&lt;!--引入我们自己编写的jQuery库--&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text/javascript\"</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"jQuery.min.js\"</span>&gt;</span><span class=\"undefined\"></span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text/javascript\"</span>&gt;</span><span class=\"javascript\">\n    $(<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\"></span>)</span>{\n        <span class=\"hljs-comment\">// 发送ajax请求，获取所有的省份。省份的pcode是null</span>\n        $.ajax({\n            <span class=\"hljs-attr\">type</span> : <span class=\"hljs-string\">\"get\"</span>,\n            <span class=\"hljs-attr\">url</span> : <span class=\"hljs-string\">\"/test1/require7\"</span>,\n            <span class=\"hljs-attr\">data</span> : <span class=\"hljs-string\">\"t=\"</span> + <span class=\"hljs-keyword\">new</span> <span class=\"hljs-built_in\">Date</span>().getTime(),\n            <span class=\"hljs-attr\">async</span> : <span class=\"hljs-literal\">true</span>,\n            <span class=\"hljs-attr\">success</span> : <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\">jsonArr</span>)</span>{\n                <span class=\"hljs-comment\">//传过来的为string对象需要通过eval函数转化为json对象才可以使用</span>\n                alert(jsonArr);\n                <span class=\"hljs-built_in\">console</span>.log(<span class=\"hljs-keyword\">typeof</span> jsonArr);\n                <span class=\"hljs-keyword\">var</span> msg = <span class=\"hljs-built_in\">eval</span>(<span class=\"hljs-string\">\"(\"</span> + jsonArr + <span class=\"hljs-string\">\")\"</span>);\n                <span class=\"hljs-built_in\">console</span>.log(msg);\n                <span class=\"hljs-comment\">// [{\"code\":\"001\", \"name\":\"河北省\"},{\"code\":\"002\", \"name\":\"河南省\"}]</span>\n                <span class=\"hljs-comment\">// 以上格式的json是我们自己设计出来的，希望服务器能够给我们返回这样一个json格式的字符串。</span>\n                <span class=\"hljs-keyword\">var</span> html = <span class=\"hljs-string\">\"&lt;option value=\'\'&gt;--请选择省份--&lt;/option&gt;\"</span>;\n                <span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">var</span> i = <span class=\"hljs-number\">0</span>; i &lt; msg.length; i++) {\n                    <span class=\"hljs-keyword\">var</span> area = msg[i]\n                    html += <span class=\"hljs-string\">\"&lt;option value=\'\"</span>+area.num+<span class=\"hljs-string\">\"\'&gt;\"</span>+area.name+<span class=\"hljs-string\">\"&lt;/option&gt;\"</span>\n                }\n                $(<span class=\"hljs-string\">\"#province\"</span>).html(html)\n            }\n        })\n\n        <span class=\"hljs-comment\">// 只要change发生，就发送ajax请求</span>\n        $(<span class=\"hljs-string\">\"#province\"</span>).change(<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\"></span>)</span>{\n            <span class=\"hljs-comment\">//alert(\"发送ajax请求\")</span>\n            <span class=\"hljs-comment\">//alert(this)</span>\n            <span class=\"hljs-comment\">//alert(this.value)</span>\n\n            <span class=\"hljs-comment\">// 发送ajax请求</span>\n            $.ajax({\n                <span class=\"hljs-attr\">type</span> : <span class=\"hljs-string\">\"get\"</span>,\n                <span class=\"hljs-attr\">url</span> : <span class=\"hljs-string\">\"/test1/require7\"</span>,\n                <span class=\"hljs-attr\">data</span> : <span class=\"hljs-string\">\"t=\"</span> + <span class=\"hljs-keyword\">new</span> <span class=\"hljs-built_in\">Date</span>().getTime() + <span class=\"hljs-string\">\"&amp;pcnum=\"</span> + <span class=\"hljs-keyword\">this</span>.value,\n                <span class=\"hljs-attr\">async</span> : <span class=\"hljs-literal\">true</span>,\n                <span class=\"hljs-attr\">success</span> : <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\">jsonArr</span>)</span>{\n                    <span class=\"hljs-comment\">// [{\"code\":\"006\", \"name\":\"XXX\"},{\"code\":\"008\", \"name\":\"YYYY\"}]</span>\n                    <span class=\"hljs-keyword\">var</span> msg = <span class=\"hljs-built_in\">eval</span>(<span class=\"hljs-string\">\"(\"</span> + jsonArr + <span class=\"hljs-string\">\")\"</span>);\n                    <span class=\"hljs-keyword\">var</span> html = <span class=\"hljs-string\">\"&lt;option value=\'\'&gt;--请选择市--&lt;/option&gt;\"</span>;\n                    <span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">var</span> i = <span class=\"hljs-number\">0</span>; i &lt; msg.length; i++) {\n                        <span class=\"hljs-keyword\">var</span> area = msg[i]\n                        html += <span class=\"hljs-string\">\"&lt;option value=\'\"</span>+area.num+<span class=\"hljs-string\">\"\'&gt;\"</span>+area.name+<span class=\"hljs-string\">\"&lt;/option&gt;\"</span>\n                    }\n                    $(<span class=\"hljs-string\">\"#city\"</span>).html(html)\n                }\n            })\n        })\n    })\n</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">select</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"province\"</span>&gt;</span>\n    <span class=\"hljs-comment\">&lt;!--&lt;option value=\"\"&gt;&amp;#45;&amp;#45;请选择省份&amp;#45;&amp;#45;&lt;/option&gt;\n    &lt;option value=\"001\"&gt;河北省&lt;/option&gt;\n    &lt;option value=\"002\"&gt;河南省&lt;/option&gt;--&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">select</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">select</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"city\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">select</span>&gt;</span>\n\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">body</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">html</span>&gt;</span>\n</span></code></div></pre>\n<blockquote>\n<p>后端页面(此处省略了area的bean对象)</p>\n</blockquote>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-keyword\">package</span> com.kabu.ajax.sevelet;\n\n<span class=\"hljs-keyword\">import</span> com.alibaba.fastjson.JSON;\n<span class=\"hljs-keyword\">import</span> com.kabu.ajax.beans.area;\n\n<span class=\"hljs-keyword\">import</span> javax.servlet.ServletException;\n<span class=\"hljs-keyword\">import</span> javax.servlet.annotation.WebServlet;\n<span class=\"hljs-keyword\">import</span> javax.servlet.http.HttpServlet;\n<span class=\"hljs-keyword\">import</span> javax.servlet.http.HttpServletRequest;\n<span class=\"hljs-keyword\">import</span> javax.servlet.http.HttpServletResponse;\n<span class=\"hljs-keyword\">import</span> java.io.IOException;\n<span class=\"hljs-keyword\">import</span> java.io.PrintWriter;\n<span class=\"hljs-keyword\">import</span> java.sql.*;\n<span class=\"hljs-keyword\">import</span> java.util.ArrayList;\n<span class=\"hljs-keyword\">import</span> java.util.List;\n<span class=\"hljs-meta\">@WebServlet</span>(<span class=\"hljs-string\">\"/require7\"</span>)\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">ajaxservlet7</span> <span class=\"hljs-keyword\">extends</span> <span class=\"hljs-title\">HttpServlet</span> </span>{\n    <span class=\"hljs-meta\">@Override</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">protected</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">doGet</span><span class=\"hljs-params\">(HttpServletRequest req, HttpServletResponse resp)</span> <span class=\"hljs-keyword\">throws</span> ServletException, IOException </span>{\n        <span class=\"hljs-comment\">//判断是否改变下拉列表</span>\n        String pcnum = req.getParameter(<span class=\"hljs-string\">\"pcnum\"</span>);\n        <span class=\"hljs-comment\">//连接数据库</span>\n        Connection conn=<span class=\"hljs-keyword\">null</span>;\n        PreparedStatement pre=<span class=\"hljs-keyword\">null</span>;\n        ResultSet res=<span class=\"hljs-keyword\">null</span>;\n        List&lt;area&gt; arealist=<span class=\"hljs-keyword\">new</span> ArrayList&lt;area&gt;();\n        <span class=\"hljs-keyword\">try</span>{\n            Class.forName(<span class=\"hljs-string\">\"com.mysql.cj.jdbc.Driver\"</span>);\n            conn= DriverManager.getConnection(<span class=\"hljs-string\">\"jdbc:mysql://localhost:3306/bjpowernode?useSSL=false&amp;serverTimezone=UTC\"</span>,<span class=\"hljs-string\">\"root\"</span>,<span class=\"hljs-string\">\"abc666666\"</span>);\n            String sql=<span class=\"hljs-string\">\"\"</span>;\n            System.out.println(<span class=\"hljs-string\">\"连接成功\"</span>);\n            <span class=\"hljs-keyword\">if</span>(pcnum==<span class=\"hljs-keyword\">null</span>){\n                sql=<span class=\"hljs-string\">\"select num,name from t_list where pcnum is null\"</span>;\n                pre=conn.prepareStatement(sql);\n            }<span class=\"hljs-keyword\">else</span>{\n                sql=<span class=\"hljs-string\">\"select num,name from t_list where pcnum=?\"</span>;\n                pre=conn.prepareStatement(sql);\n                pre.setString(<span class=\"hljs-number\">1</span>,pcnum);\n            }\n            <span class=\"hljs-comment\">//执行sql</span>\n            res=pre.executeQuery();\n            <span class=\"hljs-comment\">//处理结果集</span>\n            <span class=\"hljs-keyword\">while</span> (res.next()){\n                String num = res.getString(<span class=\"hljs-string\">\"num\"</span>);\n                String name = res.getString(<span class=\"hljs-string\">\"name\"</span>);\n                area a = <span class=\"hljs-keyword\">new</span> area(num, name);\n                arealist.add(a);\n            }\n        }<span class=\"hljs-keyword\">catch</span> (Exception e){\n            e.printStackTrace();\n        }<span class=\"hljs-keyword\">finally</span> {\n            <span class=\"hljs-keyword\">if</span>(res!=<span class=\"hljs-keyword\">null</span>){\n                <span class=\"hljs-keyword\">try</span> {\n                    res.close();\n                } <span class=\"hljs-keyword\">catch</span> (Exception e) {\n                    e.printStackTrace();\n                }\n            }\n            <span class=\"hljs-keyword\">if</span>(pre!=<span class=\"hljs-keyword\">null</span>){\n                <span class=\"hljs-keyword\">try</span> {\n                    pre.close();\n                } <span class=\"hljs-keyword\">catch</span> (Exception e) {\n                    e.printStackTrace();\n                }\n            }\n            <span class=\"hljs-keyword\">if</span>(conn!=<span class=\"hljs-keyword\">null</span>){\n                <span class=\"hljs-keyword\">try</span> {\n                    conn.close();\n                } <span class=\"hljs-keyword\">catch</span> (Exception e) {\n                    e.printStackTrace();\n                }\n            }\n        }\n        resp.setContentType(<span class=\"hljs-string\">\"text/html;charset=UTF-8\"</span>);\n        PrintWriter out = resp.getWriter();\n        <span class=\"hljs-comment\">//使用fastjason将java对象转换为json对象</span>\n        String json = JSON.toJSONString(arealist);\n        <span class=\"hljs-comment\">//输出json</span>\n        out.print(json);\n    }\n}\n</code></div></pre>\n', 1730419172781637634);
